INSERT INTO `mdl_tool_customlang` VALUES ('246', 'es', '1', 'cookiesenabled', 'Cookies must be enabled in your browser', 'Las \'Cookies\' deben estar habilitadas en su navegador', null, '1472075857', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('247', 'es', '1', 'cookiesenabled_help', 'Two cookies are used by this site:\n\nThe essential one is the session cookie, usually called MoodleSession. You must allow this cookie into your browser to provide continuity and maintain your login from page to page. When you log out or close the browser this cookie is destroyed (in your browser and on the server).\n\nThe other cookie is purely for convenience, usually called something like MOODLEID. It just remembers your username within the browser. This means when you return to this site the username field on the login page will be already filled out for you. It is safe to refuse this cookie - you will just have to retype your username every time you log in.', '<p>Este sitio utiliza dos \"cookies\".</p>\n\n<p>La esencial es la de sesión, normalmente llamada <b>MoodleSession</b>.\nDebe permitir que su navegador la acepte para poder mantener el servicio\nfuncionando de una página a otra. Cuando sale de la plataforma o cierra su navegador la \'cookie\' se destruye (en su navegador y en el servidor).</p>\n\n<p>La otra \'cookie\', normalmente llamada <b>MOODLEID</b>, es para su comodidad. Se limita a recordar su nombre de usuario dentro del navegador. Esto significa que cuando\nregrese al sitio se escribirá automáticamente su nombre en el campo nombre de usuario\n(userid). Si desea mayor seguridad no utilice esta opción: sólo tendrá que escribir su nombre manualmente cada vez que quiera ingresar.</p>', null, '1472075857', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('248', 'es', '1', 'cookiesnotenabled', 'Unfortunately, cookies are currently not enabled in your browser', 'Las \'cookies\' no están habilitadas en su navegador', null, '1472075857', null, '0', '0');
