INSERT INTO `mdl_tool_customlang` VALUES ('491', 'es', '1', 'edhelpaspellpath', 'To use spell-checking within the editor, you MUST have <strong>aspell 0.50</strong> or later installed on your server, and you must specify the correct path to access the aspell binary.  On Unix/Linux systems, this path is usually <strong>/usr/bin/aspell</strong>, but it might be something else.', 'Para usar un revisor de ortografía dentro del editor, usted DEBE tener instalado <strong>aspell 0.50</strong> o superior en su servidor, y debe especificar la ruta correcta de acceso al aspell binario. En sistemas Unix/Linux, esta ruta normalmente es <strong>/usr/bin/aspell</strong>, pero podría ser cualquiera otra.', null, '1472075881', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('492', 'es', '1', 'edhelpbgcolor', 'Define the edit area\'s background color.<br />Valid values are, for example: #FFFFFF or white', 'Defina el color de fondo del área de edición.<br />Valores válidos son, por ejemplo: #ffffff o \'white\'', null, '1472075881', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('493', 'es', '1', 'edhelpcleanword', 'This setting enables or disables Word-specific format filtering.', 'Este ajuste activa o desactiva el filtro de formato específico Word.', null, '1472075881', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('494', 'es', '1', 'edhelpenablespelling', 'Enable or disable spell-checking. When enabled, <strong>aspell</strong> must be installed on the server. The second value is the <strong>default dictionary</strong>. This value will be used if aspell doesn\'t have dictionary for users own language.', 'Activa o desactiva la corrección ortográfica. Cuando está activado, <strong>aspell</strong> debe estar instalado en el servidor.', null, '1472075881', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('495', 'es', '1', 'edhelpfontfamily', 'The font-family property is a list of font family names and/or generic family names. Family names must be separated with comma.', 'La propiedad familia de fuentes es una lista de nombres de fuentes y/o nombres de una familia genérica. Los nombres de la familia deben estar separados por comas.', null, '1472075881', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('496', 'es', '1', 'edhelpfontlist', 'Define the fonts used on editors dropdown menu.', 'Defina las fuentes usadas en el menú emergente de editores.', null, '1472075881', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('497', 'es', '1', 'edhelpfontsize', 'The default font-size sets the size of a font. <br />Valid values are for example: medium, large, smaller, larger, 10pt, 11px.', 'El tamaño por defecto de la fuente ajusta dicho tamaño. <br />Valores válidos son, por ejemplo: medium, large, smaller, larger, 10pt, 11px.', null, '1472075881', null, '0', '0');
