INSERT INTO `mdl_tool_customlang` VALUES ('535', 'es', '1', 'emailalreadysent', 'A password reset email has already been sent. Please check your email.', 'Se ha enviado un correo electrónico de restablecimiento de contraseña. Por favor, consulte su buzón de correo electrónico.', null, '1472075884', null, '0', '0');
