INSERT INTO `mdl_tool_customlang` VALUES ('538', 'es', '1', 'emailconfirm', 'Confirm your account', 'Confirme su cuenta', null, '1472075885', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('539', 'es', '1', 'emailconfirmation', 'Hi {$a->firstname},\n\nA new account has been requested at \'{$a->sitename}\'\nusing your email address.\n\nTo confirm your new account, please go to this web address:\n\n{$a->link}\n\nIn most mail programs, this should appear as a blue link\nwhich you can just click on.  If that doesn\'t work,\nthen cut and paste the address into the address\nline at the top of your web browser window.\n\nIf you need help, please contact the site administrator,\n{$a->admin}', 'Hola, {$a->firstname}.\n\nSe ha solicitado la apertura de una cuenta en\n\'{$a->sitename}\' utilizando su dirección de correo.\n\nPara completar el proceso de inscripción haga clic aquí:\n\n{$a->link}\n\nEn la mayoría de programas de correo electrónico este\nenlace debería aparecer en azul. Si no funciona, córtelo y\npéguelo en la ventana de direcciones de su navegador.\n\nSi necesita ayuda, contacte por favor con el administrador\ndel sitio,\n{$a->admin}', null, '1472075885', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('540', 'es', '1', 'emailconfirmationsubject', '{$a}: account confirmation', 'Confirmación de la cuenta  {$a}', null, '1472075885', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('541', 'es', '1', 'emailconfirmsent', '<p>An email should have been sent to your address at <b>{$a}</b></p>\n   <p>It contains easy instructions to complete your registration.</p>\n   <p>If you continue to have difficulty, contact the site administrator.</p>', '<p>Hemos enviado un correo electrónico a <b>{$a}</b></p>\n<p>En él encontrará instrucciones sencillas para concluir el proceso.</p>\n<p>Si tuviera alguna dificultad, contacte con el Administrador del Sistema.</p>', null, '1472075885', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('542', 'es', '1', 'emaildigest', 'Email digest type', 'Tipo de resumen de correo', null, '1472075885', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('543', 'es', '1', 'emaildigest_help', 'This is the daily digest setting that forums will use by default.\n\n* No digest - you will receive one e-mail per forum post;\n* Digest - complete posts - you will receive one digest e-mail per day containing the complete contents of each forum post;\n* Digest - subjects only - you will receive one digest e-mail per day containing just the subject of each forum post.\n\nYou can also choose a different setting for each forum if you wish.', 'Este es el ajuste de resumen diario que usarán los foros por defecto.\n\n* Sin resumen - recibirá un correo electrónico por cada mensaje del foro;\n* Resumen - mensaje completo - recibirá un correo resumen por día con los contenidos completos de cada mensaje del foro;\n* Resumen - solo asuntos - recibirá un correo resumen por día solo con los asuntos de cada mensaje del foro.\n\nPuede elegir también un ajuste diferente para cada uno de los foros, si así lo desea.', null, '1472075885', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('544', 'es', '1', 'emaildigestcomplete', 'Complete (daily email with full posts)', 'Completo (correo diario con mensajes completos)', null, '1472075885', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('545', 'es', '1', 'emaildigestoff', 'No digest (single email per forum post)', 'Sin resumen (un correo por cada mensaje del foro)', null, '1472075885', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('546', 'es', '1', 'emaildigestsubjects', 'Subjects (daily email with subjects only)', 'Por temas (correo diario sólo con temas)', null, '1472075885', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('547', 'es', '1', 'emaildisable', 'This email address is disabled', 'La dirección de correo no está habilitada', null, '1472075885', null, '0', '0');
