INSERT INTO `mdl_tool_customlang` VALUES ('549', 'es', '1', 'emaildisplay', 'Email display', 'Mostrar correo', null, '1472075885', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('550', 'es', '1', 'emaildisplaycourse', 'Allow only other course members to see my email address', 'Mostrar mi dirección de correo sólo a mis compañeros de curso', null, '1472075885', null, '0', '0');
