INSERT INTO `mdl_tool_customlang` VALUES ('555', 'es', '1', 'emailenableclick', 'Click here to re-enable all email being sent to this address', 'Haga clic aquí para volver a activar el envío de correo a esta dirección', null, '1472075886', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('556', 'es', '1', 'emailexists', 'This email address is already registered.', 'Esta dirección de correo ya está registrada.', null, '1472075886', null, '0', '0');
