INSERT INTO `mdl_tool_customlang` VALUES ('559', 'es', '1', 'emailmustbereal', 'Note: your email address must be a real one', 'IMPORTANTE: Para concluir el proceso debe escribir una dirección de correo verdadera', null, '1472075886', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('560', 'es', '1', 'emailnotallowed', 'Email addresses in these domains are not allowed ({$a})', 'Las direcciones email de estos dominios no están permitidas ({$a})', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('561', 'es', '1', 'emailnotfound', 'The email address was not found in the database', 'No se ha encontrado la dirección email en la base de datos', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('562', 'es', '1', 'emailonlyallowed', 'This email is not one of those that are allowed ({$a})', 'Este email no figura entre los permitidos ({$a})', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('563', 'es', '1', 'emailpasswordconfirmation', 'Hi {$a->firstname},\n\nSomeone (probably you) has requested a new password for your\naccount on \'{$a->sitename}\'.\n\nTo confirm this and have a new password sent to you via email,\ngo to the following web address:\n\n{$a->link}\n\nIn most mail programs, this should appear as a blue link\nwhich you can just click on.  If that doesn\'t work,\nthen cut and paste the address into the address\nline at the top of your web browser window.\n\nIf you need help, please contact the site administrator,\n{$a->admin}', 'Hola, {$a->firstname}.\n\nRecibimos la solicitud de nueva contraseña para su cuenta\nen \'{$a->sitename}\'.\n\nPara concluir el proceso y poder enviarle una nueva contraseña por correo,\ndiríjase a la siguiente dirección:\n\n{$a->link}\n\nEn la mayoría de programas de correo electrónico el\nenlace anterior debería aparecer en azul y puede hacer\nclic sobre él. Si no funcionara, córtelo y péguelo en la\nventana de direcciones de su navegador.\n\nSi necesita ayuda adicional, póngase en contacto con el\nadministrador, {$a->admin}', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('564', 'es', '1', 'emailpasswordconfirmationsubject', '{$a}: Change password confirmation', '{$a}: confirmación de cambio de contraseña', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('565', 'es', '1', 'emailpasswordconfirmmaybesent', '<p>If you supplied a correct username or email address then an email should have been sent to you.</p>\n   <p>It contains easy instructions to confirm and complete this password change.\nIf you continue to have difficulty, please contact the site administrator.</p>', '<p>Si ha suministrado un nombre de usuario o dirección correctos, se le debería haber enviado un email.</p>\n<p>Contiene instrucciones sencillas para confirmar y completar el cambio de contraseña.\nSi sigue teniendo dificultades, contacte por favor con el administrador del sitio.</p>', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('566', 'es', '1', 'emailpasswordconfirmnoemail', '<p>The user account you specified does not have a recorded email address.</p>\n   <p>Please contact the site administrator.</p>', '<p> La cuenta de usuario que ha especificado no tiene una dirección de correo electrónico registrada. </p><p> Por favor, póngase en contacto con el administrador del sitio. </p>', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('567', 'es', '1', 'emailpasswordconfirmnotsent', '<p>The user detail you supplied does not identify an existing user account.</p>\n   <p>Please check the information you entered, then try again.\nIf you continue to have difficulty, please contact the site administrator.</p>', '<p> Los datos de usuario que ha introducido no identifican una cuenta de usuario existente. </p><p> Compruebe la información introducida por favor y vuelva a intentarlo. Si continúa teniendo problemas, por favor póngase en contacto con el administrador del sitio. </p>', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('568', 'es', '1', 'emailpasswordconfirmsent', 'An email should have been sent to your address at <b>{$a}</b>.\n<br />It contains easy instructions to confirm and complete this password change.\nIf you continue to have difficulty, contact the site administrator.', 'Hemos enviado un correo a su dirección <b>{$a}</b>.\n<p>Este mensaje contiene instrucciones sencillas para completar y confirmar el cambio de contraseña.\nSi tuviera alguna dificultad, contacte con el Administrador.</p>', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('569', 'es', '1', 'emailpasswordchangeinfo', 'Hi {$a->firstname},\n\nSomeone (probably you) has requested a new password for your\naccount on \'{$a->sitename}\'.\n\nTo change your password, please go to the following web address:\n\n{$a->link}\n\nIn most mail programs, this should appear as a blue link\nwhich you can just click on.  If that doesn\'t work,\nthen cut and paste the address into the address\nline at the top of your web browser window.\n\nIf you need help, please contact the site administrator,\n{$a->admin}', 'Hola, {$a->firstname}.\n\nAlguien (seguramente usted) ha solicitado una nueva contraseña para su\ncuenta en \'{$a->sitename}\'.\n\nPara cambiar su contraseña, por favor, diríjase a la siguiente dirección:\n\n{$a->link}\n\nEn la mayoría de los programas de correo electrónico, esto aparecerá como un enlace en color azul en el que usted puede hacer clic. Si no funcionara, copie y pegue la dirección en la barra de navegación de su navegador.', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('570', 'es', '1', 'emailpasswordchangeinfodisabled', 'Hi {$a->firstname},\n\nSomeone (probably you) has requested a new password for your\naccount on \'{$a->sitename}\'.\n\nUnfortunately your account on this site is disabled and can not be reset,\nplease contact the site administrator,\n{$a->admin}', 'Hola, {$a->firstname}.\n\nSe ha solicitado una nueva contraseña para su cuenta en \'{$a->sitename}\'.\n\nDesafortunadamente, su cuenta en este sitio ha sido desactivada y no puede ser reactivada. Por favor, contacte con el administrador del sitio, {$a->admin}', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('571', 'es', '1', 'emailpasswordchangeinfofail', 'Hi {$a->firstname},\n\nSomeone (probably you) has requested a new password for your\naccount on \'{$a->sitename}\'.\n\nUnfortunately passwords can not be reset on this site,\nplease contact the site administrator,\n{$a->admin}', 'Hola, {$a->firstname}.\n\nAlguien (seguramente usted) ha solicitado una nueva contraseña para su\ncuenta en \'{$a->sitename}\'.\n\nLo sentimos, pero las contraseñas no pueden cambiarse en este sitio. Contacte por favor con el administrador,\n{$a->admin}', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('572', 'es', '1', 'emailpasswordchangeinfosubject', '{$a}: Change password information', '{$a}: Cambiar información sobre la contraseña', null, '1472075887', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('573', 'es', '1', 'emailpasswordsent', 'Thank you for confirming the change of password.\nAn email containing your new password has been sent to your address at<br /><b>{$a->email}</b>.<br />\nThe new password was automatically generated - you might like to\n<a href=\"{$a->link}\">change your password</a> to something easier to remember.', 'Gracias por confirmar el cambio de contraseña.\n<p>Ya le enviamos un correo con su nueva contraseña a <b>{$a->email}</b>.</p>\n<p>La nueva contraseña ha sido generada automáticamente.\nLe recomendamos que <a href=\"{$a->link}\">cambie su contraseña</a> por otra más fácil de recordar.</p>', null, '1472075888', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('574', 'es', '1', 'emailresetconfirmation', 'Hi {$a->firstname},\n\nA password reset was requested for your account \'{$a->username}\' at {$a->sitename}.\n\nTo confirm this request, and set a new password for your account, please\ngo to the following web address:\n\n{$a->link}\n(This link is valid for {$a->resetminutes} minutes from the time this reset was first requested)\n\nIf this password reset was not requested by you, no action is needed.\n\nIf you need help, please contact the site administrator,\n{$a->admin}', 'Hola {$a->firstname}.\n\nUsted solicitó un restablecimiento de contraseña para su cuenta \'{$a->username}\' en {$a->sitename}.\n\nPara confirmar esta petición, y establecer una nueva contraseña para su cuenta, por favor vaya a la siguiente dirección de Internet: {$a->link} (Este enlace es válido durante  {$a->resetminutes} minutos desde el momento en que hizo la solicitud por primera vez .\n\nSi usted no ha solicitado este restablecimiento de contraseña, no necesita realizar ninguna acción.\n\nSi necesita ayuda, por favor póngase en contacto con el administrador del sitio, {$a->admin}', null, '1472075888', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('575', 'es', '1', 'emailresetconfirmationsubject', '{$a}: Password reset request', '{$a}: Solicitud de restablecimiento de contraseña', null, '1472075888', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('576', 'es', '1', 'emailresetconfirmsent', 'An email has been sent to your address at <b>{$a}</b>.\n<br />It contains easy instructions to confirm and complete this password change.\nIf you continue to have difficulty, contact the site administrator.', 'Se ha enviado un correo electrónico a su dirección en <b>{$a}.</b> <br /> Contiene unas sencillas instrucciones para confirmar y completar el cambio de contraseña.\nSi continúa teniendo problemas, póngase en contacto con el administrador del sitio.', null, '1472075888', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('577', 'es', '1', 'emailtoprivatefiles', 'You can also e-mail files as attachments straight to your private files space. Simply attach your files to an e-mail and send it to {$a}', 'También puede enviar directamente archivos vía e-mail a esta zona de archivos privados. Simplemente adjunte sus archivos a un correo electrónico y envíelo a la dirección de correo electrónico {$a}', null, '1472075888', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('578', 'es', '1', 'emailtoprivatefilesdenied', 'Your administrator has disabled the option to upload your own private files.', 'El administrador ha desactivado la opción de subir sus propios ficheros privados.', null, '1472075888', null, '0', '0');
