INSERT INTO `mdl_tool_customlang` VALUES ('682', 'es', '1', 'format_help', 'The course format determines the layout of the course page.\n\n* Single activity format - For displaying a single activity or resource (such as a Quiz or SCORM package) on the course page\n* Social format - A forum is displayed on the course page\n* Topics format - The course page is organised into topic sections\n* Weekly format - The course page is organised into weekly sections, with the first week starting on the course start date', 'El formato del curso determina el diseño de la página del curso.\n\n* Formato de actividad única  - Visualiza una única actividad o recurso (como un Cuestionario o un paquete SCORM)\n\n* Formato Social - Se muestra un foro en la página del curso\n\n* Formato de Temas - La página del curso se organiza en secciones temáticas\n\n* Formato semanal - la página del curso está organizado en secciones semanales, con la primera semana a partir de la fecha de inicio del curso', null, '1472075897', null, '0', '0');
