INSERT INTO `mdl_tool_customlang` VALUES ('813', 'es', '1', 'idnumbergroup_help', 'The ID number of a group is only used when matching the group against external systems and is not displayed anywhere on the site. If the group has an official code name it may be entered, otherwise the field can be left blank.', 'El número ID de un grupo sólo se usa cuando se compara el grupo con un sistema externo, y no se muestra en ningún otror lugar del sitio. Si el grupo tiene un código oficial, entonces se puede introducr este, de lo contrario, el campo se puede dejar en blanco.', null, '1472075910', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('814', 'es', '1', 'idnumbergrouping', 'Grouping ID number', 'Número de identificación del agrupamiento', null, '1472075910', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('815', 'es', '1', 'idnumbergrouping_help', 'The ID number of a grouping is only used when matching the grouping against external systems and is not displayed anywhere on the site. If the grouping has an official code name it may be entered, otherwise the field can be left blank.', 'El número ID de una agrupación sólo se usa cuando se compara la agrupación en un sistema externo y no se muestra en cualquier lugar en el sitio. Si la agrupación tiene un código oficial se pueden introducir, de lo contrario el campo se puede dejar en blanco.', null, '1472075910', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('816', 'es', '1', 'idnumbermod', 'ID number', 'Número ID', null, '1472075910', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('817', 'es', '1', 'idnumbermod_help', 'Setting an ID number provides a way of identifying the activity for grade calculation purposes. If the activity is not included in any grade calculation then the ID number field may be left blank.\n\nThe ID number can also be set in the gradebook, though it can only be edited on the activity settings page.', 'El número ID proporciona una forma de identificar la actividad a fin de poder calcular la calificación. Si la actividad no está incluida en ningún cálculo de calificación, el campo Número ID puede dejarse en blanco. El Número ID puede asimismo ajustarse en la página de edición del cálculo de calificaciones, si bien únicamente\npuede editarse en la página de actualización de la actividad.', null, '1472075910', null, '0', '0');
