INSERT INTO `mdl_tool_customlang` VALUES ('896', 'es', '1', 'loginaspasswordexplain', '<p>You must enter the special \"loginas password\" to use this feature.<br />If you do not know it, ask your server administrator.</p>', '<p>Debe introducir la \"loginas password\" especial para usar esta característica.<br />Si no la sabe, pregunte al administrador de su servidor.</p>', null, '1472075918', null, '0', '0');
