INSERT INTO `mdl_tool_customlang` VALUES ('1073', 'es', '1', 'newsitemsnumber_help', 'This setting determines how many recent items appear in the latest news block on the course page. If set to \"0 news items\" then the latest news block will not be displayed.', '<P>En los formatos semanal y de temas aparece un foro llamado\n\"Novedades\". Es un buen lugar para\ncolocar los mensajes que se desea que lean los alumnos.\n(Dado que todos los alumnos son automáticamente suscritos\na este foro, recibirán en su correo los mensajes que se coloquen aquí).</P>\n\n<P>Este parámetro determina cuántos de los últimos mensajes\naparecerán en la página de inicio del curso, en la casilla de novedades en la parte derecha de la página.</P>\n\n<P>Si su elección es \"0\" no se mostrarán novedades en la página.</P>', null, '1472075931', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1074', 'es', '1', 'newuser', 'New user', 'Nuevo usuario', null, '1472075931', null, '0', '0');
