INSERT INTO `mdl_tool_customlang` VALUES ('1189', 'es', '1', 'passwordforgotteninstructions', 'Your details must first be found in the user database. Please enter <strong>either</strong> your username or your registered email address in the appropriate box. There is no need to enter both.', 'Sus detalles deben encontrarse primero en la base de datos del usuario. Por favor, escriba <strong>o bien</strong> su nombre de usuario o bien su dirección registrada de correo electrónico en el recuadro apropiado. No es necesario escribir ambos.', null, '1472075942', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1190', 'es', '1', 'passwordforgotteninstructions2', 'To reset your password, submit your username or your email address below. If we can find you in the database, an email will be sent to your email address, with instructions how to get access again.', 'Para reajustar su contraseña, envíe su nombre de usuario o su dirección de correo electrónico. Si podemos encontrarlo en la base de datos, le enviaremos un email con instrucciones para poder acceder de nuevo.', null, '1472075942', null, '0', '0');
