INSERT INTO `mdl_tool_customlang` VALUES ('1197', 'es', '1', 'passwordsenttext', '<p>An email has been sent to your address at {$a->email}.</p>\n   <p><b>Please check your email for your new password</b></p>\n   <p>The new password was automatically generated, so you might like to\n   <a href=\"{$a->link}\">change it to something easier to remember</a>.</p>', '<p>El sistema ha enviado un correo electrónico a {$a->email}.</p>\n<p><b>Revise su correo para recibir una nueva contraseña</b></p>\n<p>La nueva contraseña se genera automáticamente, por lo que tal vez usted desee\n<a href=\"{$a->link}\">cambiarla</a> por una que le sea más fácil recordar.</p>', null, '1472075943', null, '0', '0');
