INSERT INTO `mdl_tool_customlang` VALUES ('1358', 'es', '1', 'rsserrorauth', 'Your RSS link does not contain a valid authentication token.', 'Su enlace RSS no contiene una ficha de identificación válida.', null, '1472075956', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1359', 'es', '1', 'rsserrorguest', 'This feed uses guest access to access the data, but guest does not have permission to read the data. Visit the original location that this feed comes from (URL) as a valid user and get a new RSS link from there.', 'Esta fuente utiliza el acceso de invitados para acceder a los datos, pero el invitado no tiene permiso para leer los datos. Visite la ubicación original de la que esta fuente proviene (URL) como un usuario válido y obtenga de allí un nuevo enlace RSS.', null, '1472075956', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1360', 'es', '1', 'rsskeyshelp', '<p>To ensure security and privacy, RSS feed URLs contain a special token that identifies the user they are for. This prevents other users from accessing areas of the site where they are not allowed.</p><p>The token is automatically created the first time you access an area that produces an RSS feed. If you think that your RSS feed token has been compromised, you can request a new one by clicking the reset link. Please note that your current RSS feed URLs will then become invalid.</p>', '<p>Para garantizar la seguridad y la privacidad, las direcciones URL RSS feed contienen un \'testigo\' especial que identifica al usuario para el que son. Esto impide que otros usuarios accedan a áreas de Moodle a las que no deben tener acceso.</p><p>Este \'testigo\' se crea automáticamente la primera vez que accede a un área que produce una fuente RSS. Si usted piensa que su \'testigo\' de fuente RSS ha sido comprometido de alguna manera, usted puede solicitar uno nuevo haciendo clic en el vínculo restablecer enlace. Tenga en cuenta que la URL de la fuente RSS actual dejará de ser válida.</p>', null, '1472075956', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1361', 'es', '1', 'rsstype', 'RSS feed for this activity', 'Canal RSS para esta actividad', null, '1472075957', null, '0', '0');
