INSERT INTO `mdl_tool_customlang` VALUES ('1383', 'es', '1', 'scalestip2', 'To create custom scales, click the Grades link in the course administration menu, then choose Edit, Scales.', 'Para crear escalas personalizadas, haga clic en el enlace Calificaciones del menú de administración del curso, luego seleccione Editar, Escalas.', null, '1472075959', null, '0', '0');
