INSERT INTO `mdl_tool_customlang` VALUES ('1386', 'es', '1', 'search_help', 'For basic searching of one or more words anywhere in the text, just type them separated by spaces. All words longer than two characters are used.\n\nFor advanced searching, press the search button without typing anything in the search box to access the advanced search form.', 'Para realizar una búsqueda básica de una o más palabras en cualquier lugar del texto, simplemente escríbalas separadas por espacios. Se usarán todas las palabras de más de dos caracteres.\n\nPara realizar una búsqueda avanzada, pulse el botón de búsqueda sin teclear nada en la caja de texto.', null, '1472075959', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1387', 'es', '1', 'searchagain', 'Search again', 'Volver a buscar', null, '1472075959', null, '0', '0');
