INSERT INTO `mdl_tool_customlang` VALUES ('1444', 'es', '1', 'setpasswordinstructions', 'Please enter and repeat your new password below, then click \"Set password\". <br />Your new password will be saved, and you will be logged in.', 'Por favor, introduzca y repita a continuación la nueva contraseña, haga clic en \"Establecer contraseña\";. <br /> Su nueva contraseña se guardará, y usted será identificado.', null, '1472075966', null, '0', '0');
