INSERT INTO `mdl_tool_customlang` VALUES ('1449', 'es', '1', 'shortnamecourse_help', 'The short name of the course is displayed in the navigation and is used in the subject line of course email messages.', '<P>Muchas instituciones asignan nombres cortos a sus cursos para efectos\nadministrativos, como BP102 o 4H-LIT. Si ya lo hace, escríbalo aquí; si no,\ninvente uno y escríbalo aquí. Se utilizará en diferentes lugares en los que\nun nombre completo sería inadecuado, como en la linea \"asunto\" del correo.\n</P>', null, '1472075967', null, '0', '0');
