INSERT INTO `mdl_tool_customlang` VALUES ('1464', 'es', '1', 'showdescription_help', 'If enabled, the description above will be displayed on the course page just below the link to the activity or resource.', 'Si se activa, la descripción anterior se mostrará en la página del curso justo debajo del enlace a la actividad o recurso.', null, '1472075968', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1465', 'es', '1', 'showgrades', 'Show gradebook to students', 'Mostrar libro de calificaciones a los estudiantes', null, '1472075968', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1466', 'es', '1', 'showgrades_help', 'Many activities in the course allow grades to be set. This setting determines whether a student can view a list of all their grades for the course via a grades link in the course administration block.', '<p>Muchas de las actividades permiten otorgar calificaciones.</p>\n\n<p>Por defecto, los resultados de todas las calificaciones\n   del curso aparecen en la sección de Calificaciones,\n   disponible en la página principal del curso.</p>\n\n<p>Si un profesor no está interesado en usar calificaciones\n   en un curso o, simplemente quiere ocultarlas a los\n   alumnos, puede desactivar la visualización de las\n   calificaciones en la Configuración del Curso. Esto no impide usar o establecer calificaciones para actividades\n   individuales: únicamente impide que los alumnos vean\n   los resultados.</p>', null, '1472075968', null, '0', '0');
