INSERT INTO `mdl_tool_customlang` VALUES ('1817', 'es', '3', 'additionalhtml', 'Additional HTML', 'HTML adicional', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1818', 'es', '3', 'additionalhtml_heading', 'Additional HTML to be added to every page.', 'HTML adicional que se añade a cada página.', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1819', 'es', '3', 'additionalhtml_desc', 'These settings allow you to specify HTML that you want added to every page. You can set HTML that will be added within the HEAD tag for the page, immediately after the BODY tag has been opened, or immediately before the body tag is closed.<br />Doing this allows you add custom headers or footers on every page, or add support for services like Google Analytics very easily and independent of your chosen theme.', 'Estos ajustes permiten especificar el código HTML que desea añadir a cada página. Puede editar el HTML que será agregado dentro de la etiqueta HEAD de la página, inmediatamente después de la etiqueta de apertura de BODY, o inmediatamente antes de la etiqueta de cierre. <br /> Hacer esto le permite agregar encabezados o pies de página en cada página, o añadir soporte para servicios como Google Analytics con mucha facilidad e independiente de la plantilla elegida.', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1820', 'es', '3', 'additionalhtmlhead', 'Within HEAD', 'Dentro del Encabezado', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1821', 'es', '3', 'additionalhtmlhead_desc', 'Content here will be added to the bottom of the HEAD tag for every page.', 'Este contenido se agregará al final de la etiqueta HEAD en cada página. ', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1822', 'es', '3', 'additionalhtmltopofbody', 'When BODY is opened', 'Cuando BODY está abierto', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1823', 'es', '3', 'additionalhtmltopofbody_desc', 'Content here will be added in to every page immediately after the opening body tag.', 'Este contenido se agregará a cada página justo después de que se abra la etiqueta BODY.', null, '1472076002', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1824', 'es', '3', 'additionalhtmlfooter', 'Before BODY is closed', 'Antes de cerrar BODY', null, '1472076003', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1825', 'es', '3', 'additionalhtmlfooter_desc', 'Content here will be added in to every page right before the body tag is closed.', 'Este contenido se agregará a cada página justo antes de que se cierre la etiqueta BODY.', null, '1472076003', null, '0', '0');
