INSERT INTO `mdl_tool_customlang` VALUES ('1833', 'es', '3', 'allowbeforeblockdesc', 'By default, entries in the blocked IPs list are matched first. If this option is enabled, entries in the allowed IPs list are processed before the blocked list.', 'Por defecto, se procesará en primer lugar la lista de IPs bloqueadas; si la opción se activa, la lista de IPs permitidas se procesará antes que la lista bloqueada.', null, '1472076004', null, '0', '0');
