INSERT INTO `mdl_tool_customlang` VALUES ('1840', 'es', '3', 'allowframembedding_help', 'If enabled, this site may be embedded in a frame in a remote system, as recommended when using the \'Publish as LTI tool\' enrolment plugin. Otherwise, it is recommended to leave frame embedding disabled for security reasons.', 'Permitir incrustar este sitio en marcos de sitios externos. No se recomienda activar esta opción por razones de seguridad.', null, '1472076004', null, '0', '0');
