INSERT INTO `mdl_tool_customlang` VALUES ('1848', 'es', '3', 'alternativefullnameformat_desc', 'This defines how names are shown to users with the viewfullnames capability (by default users with the role of manager, teacher or non-editing teacher). Placeholders that can be used are as for the \"Full name format\" setting.', 'Define como se muestran los nombres a los usuarios que tienen activado el permiso \"viewfullnames\" (por defecto, disponible en usuarios con roles de gestor, profesor o profesor sin permisos de edición). Los marcadores que pueden ser usados vienen determinados por el parámetro \'Formato de nombre completo\'.', null, '1472076005', null, '0', '0');
