INSERT INTO `mdl_tool_customlang` VALUES ('1864', 'es', '3', 'badwordsconfig', 'Enter your list of bad words separated by commas.', 'Escriba su lista de palabras censuradas, separadas por comas', null, '1472076006', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1865', 'es', '3', 'badwordsdefault', 'If the custom list is empty, a default list from the language pack will be used.', 'Si la lista personalizada está vacía, se usará una lista por defecto contenida en el paquete de idioma.', null, '1472076006', null, '0', '0');
