INSERT INTO `mdl_tool_customlang` VALUES ('1869', 'es', '3', 'blockeditingmenu_desc', 'If enabled many of the block editing icons shown when editing is on will be displayed within a drop-down menu. This reduces the content on screen by hiding the icons until they are needed.', 'Si se activa muchos de los iconos en modo de edición de bloques se muestran dentro de un menú desplegable. Esto optimiza el uso de la pantalla ocultando los iconos hasta que se necesiten.', null, '1472076007', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1870', 'es', '3', 'blockinstances', 'Instances', 'Ejemplos', null, '1472076007', null, '0', '0');
