INSERT INTO `mdl_tool_customlang` VALUES ('1881', 'es', '3', 'cachejs', 'Cache Javascript', 'Caché Javascript', null, '1472076007', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1882', 'es', '3', 'cachejs_help', 'Javascript caching and compression greatly improves page loading performance. it is strongly recommended for production sites. Developers will probably want to disable this feature.', 'El almacenamiento en caché y la conversión Javascript mejoran enormemente el rendimiento de carga de la página. Se recomienda para los sitios de producción. Los desarrolladores probablemente querrán desactivar esta función.', null, '1472076008', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1883', 'es', '3', 'calendarexportsalt', 'Calendar export salt', 'Salado de exportación de calendarios', null, '1472076008', null, '0', '0');
