INSERT INTO `mdl_tool_customlang` VALUES ('1886', 'es', '3', 'calendartype_desc', 'Choose a default calendar type for the whole site. This setting can be overridden in the course settings or by users in their personal profile.', 'Elija un tipo de calendario por defecto para todo el sitio. Este ajuste se puede sobreescribir por los ajustes de la configuración del curso o por los del perfil personal del usuario', null, '1472076008', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1887', 'es', '3', 'calendar_weekend', 'Weekend days', 'Días del fin de semana', null, '1472076008', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1888', 'es', '3', 'cannotdeletemodfilter', 'You cannot uninstall the \'{$a->filter}\' because it is part of the \'{$a->module}\' module.', 'No puede desinstalar \'{$a->filter}\' porque es parte del módulo \'{$a->module}\'.', null, '1472076008', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1889', 'es', '3', 'cannotuninstall', '{$a} can not be uninstalled.', '{$a} no se puede desinstalar.', null, '1472076008', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1890', 'es', '3', 'cfgwwwrootslashwarning', 'You have defined $CFG->wwwroot incorrectly in your config.php file. You have included a \'/\' character at the end. Please remove it, or you will experience strange bugs like <a href=\'http://tracker.moodle.org/browse/MDL-11061\'>MDL-11061</a>.', 'Ha definido $CFG->wwwroot incorrectamente en su archivo config.php. Ha incluído un carácter \'/\' al final. Por favor, elimínelo. De lo contrario, aparecerán errores extraños tales como <a href=\'http://tracker.moodle.org/browse/MDL-11061\'>MDL-11061</a>.', null, '1472076008', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('1891', 'es', '3', 'cfgwwwrootwarning', 'You have defined $CFG->wwwroot incorrectly in your config.php file. It does not match the URL you are using to access this page. Please correct it, or you will experience strange bugs like <a href=\'http://tracker.moodle.org/browse/MDL-11061\'>MDL-11061</a>.', 'Ha definido $CFG->wwwroot incorrectamente en su archivo config.php. No se corresponde con la URL que usted está usando para acceder a esta página. Por favor, corríjalo. De lo contrario, aparecerán errores extraños tales como <a href=\'http://tracker.moodle.org/browse/MDL-11061\'>MDL-11061</a>.', null, '1472076008', null, '0', '0');
