INSERT INTO `mdl_tool_customlang` VALUES ('2074', 'es', '3', 'configsectionpermissions', 'Permissions', 'Permisos', null, '1472076024', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2075', 'es', '3', 'configsectionrequestedcourse', 'Course requests', 'Solicitudes de cursos', null, '1472076024', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2076', 'es', '3', 'configsectionsecurity', 'Security', 'Seguridad', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2077', 'es', '3', 'configsectionstats', 'Statistics', 'Estadísticas', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2078', 'es', '3', 'configsectionuser', 'User', 'Usuario', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2079', 'es', '3', 'configsecureforms', 'Moodle can use an additional level of security when accepting data from web forms. If this is enabled, then the browser\'s HTTP_REFERER variable is checked against the current form address.  In a very few cases this can cause problems if the user is using a firewall (eg Zonealarm) configured to strip HTTP_REFERER from their web traffic.  Symptoms are getting \'stuck\' on a form. If your users are having problems with the login page (for example) you might want to disable this setting, although it might leave your site more open to brute-force password attacks.  If in doubt, leave this set to \'Yes\'.', 'Moodle puede usar un nivel adicional de seguridad cuando acepta datos provenientes de formularios web. Si la opción está activada, se contrastará la variable HTTP_REFERER del navegador con la dirección del formulario actual. En muy pocos casos esto ocasiona problemas si el usuario utiliza un cortafuegos (e.g., ZoneAlarm) configurado para desmontar su HTTP_REFERER del tráfico web. El síntoma consiste en quedarse \'atascasdo\' en un formulario. Si, pongamos por caso, los usuarios tuvieran problemas con la página de acceso, quizás conviniera desactivar la opción, aun con el riesgo de dejar el sitio más vulnerable a ataques de fuerza bruta. En caso de duda, seleccione la opción \'Sí\'.', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2080', 'es', '3', 'configsessioncookie', 'This setting customises the name of the cookie used for Moodle sessions.  This is optional, and only useful to avoid cookies being confused when there is more than one copy of Moodle running within the same web site.', 'Esta opción personaliza el nombre de la \'cookie\' usada para las sesiones de Moodle. Es opcional, y resulta útil únicamente para evitar que las \'cookies\' se confundan cuando hay más de una copia de Moodle ejecutándose en el mismo sitio web.', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2081', 'es', '3', 'configsessioncookiedomain', 'This allows you to change the domain that the Moodle cookies are available from. This is useful for Moodle customisations (e.g. authentication or enrolment plugins) that need to share Moodle session information with a web application on another subdomain. <strong>WARNING: it is strongly recommended to leave this setting at the default (empty) - an incorrect value will prevent all logins to the site.</strong>', 'Le permite cambiar el dominio donde están disponibles las cookies de Moodle. Es útil para la personalización de Moodle (por ejemplo, extensiones de identificación o de matriculación) que necesitan compartir información de la sesión de Moodle con una aplicación web en otro subdominio. <strong> ADVERTENCIA: se recomienda dejar este ajuste en el valor por defecto (vacío) - un valor incorrecto impedirá todos los accesos al sitio </strong>.', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2082', 'es', '3', 'configsessioncookiepath', 'If you need to change where browsers send the Moodle cookies, you can change this setting to specify a subdirectory of your web site.  Otherwise the default \'/\' should be fine.', 'Si necesita cambiar el lugar al que los navegadores envían las \'cookies\' de Moodle, cambie esta opción para especifirar un subdirectorio de su sitio web. En caso contrario, \'/\' por defecto funcionará correctamente..', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2083', 'es', '3', 'configsessiontimeout', 'If people logged in to this site are idle for a long time (without loading pages) then they are automatically logged out (their session is ended).  This variable specifies how long this time should be.', 'Si los usuarios conectados al sitio están inactivos durante mucho tiempo (i.e., sin cargar páginas), serán desconectados automáticamente (i.e., terminará la sesión). Esta variable especifica el tiempo de inactividad antes de la desconexión.', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2084', 'es', '3', 'configshowicalsource', 'Show source information for iCal events', 'Mostrar información del origen de eventos iCal', null, '1472076025', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2085', 'es', '3', 'configshowcommentscount', 'Show comments count, it will cost one more query when display comments link', 'Mostrar el número de comentarios. Supone una consulta más cuando se muestre el enlace a los comentarios', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2086', 'es', '3', 'configshowsiteparticipantslist', 'All of these site students and site teachers will be listed on the site participants list. Who shall be allowed to see this site participants list?', 'Todos los estudiantes y profesores del sitio aparecerán en la lista de participantes. ¿Quién puede ver esa lista?', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2087', 'es', '3', 'configsitedefaultlicense', 'Default site licence', 'Licencia predeterminada del sitio', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2088', 'es', '3', 'configsitedefaultlicensehelp', 'The default licence for publishing content on this site', 'Licencia predeterminada para publicar contenidos en este sitio', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2089', 'es', '3', 'configsitemaxcategorydepth', 'Maximum category depth', 'Profundidad máxima de la categoría', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2090', 'es', '3', 'configsitemaxcategorydepthhelp', 'This specifies the maximum depth of child categories expanded when displaying categories or combo list. Deeper level categories will appear as links and user can expand them with AJAX request.', 'Especifica la profundidad máxima de las subcategorías cuando se muestan las categorías o la lista combo. Las categorías de nivel más bajo aparecerán como enlaces y los usuarios pueden desplegarlas con una petición AJAX.', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2091', 'es', '3', 'configslasharguments', '\'Slash arguments\' (using <em>PATH_INFO</em>) is required for SCORM packages and multiple-file resources to display correctly. If your web server doesn\'t support \'slash arguments\' and you are unable to configure it, this setting can be disabled, though it will result in things not working.<br />Note: The use of \'slash arguments\' will be required in future versions of Moodle.', 'Los archivos (imágenes, subidas, etc.) se proporcionan vía un script que usa \'slash arguments\'. Este método permite que los archivos sean incluídos más fácilmente en la caché de los navegadores, servidores proxy, etc. Desafortunadamente, algunos servidores PHP no permiten usar este método, de modo que si usted tiene problemas para ver archivos o imágenes subidas al servidor (e.g., fotografías de los usuarios), deshabilite este ajuste.', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2092', 'es', '3', 'configsmartpix', 'With this on, icons are served through a PHP script that searches the current theme, then all parent themes, then the Moodle /pix folder. This reduces the need to duplicate image files within themes, but has a slight performance cost.', 'Cuando se activa, los inconos se sirven a través de un script PHP que busca el tema actual, luego todos los temas padre, luego la carpeta /pix de Moodle. Esto reduce la necesidad de duplicar archivos de imágenes dentro de los temas, pero tiene un pequeño costo de rendimiento.', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2093', 'es', '3', 'configstartwday', 'Start of week', 'Comienzo de la semana', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2094', 'es', '3', 'configstatsfirstrun', 'This specifies how far back the logs should be processed <b>the first time</b> the cronjob wants to process statistics. If you have a lot of traffic and are on shared hosting, it\'s probably not a good idea to go too far back, as it could take a long time to run and be quite resource intensive. (Note that for this setting, 1 month = 28 days. In the graphs and reports generated, 1 month = 1 calendar month.)', 'Esta opción especifica el momento a partir del cual deberían procesarse los registros <b>la primera vez</b> que el cronjob procesa las estadísticas. Si el sitio tiene mucho tráfico y el servidor es compartido, probablemente no sea una buena idea comenzar demasiado pronto, puesto que se tardará mucho tiempo y se consumirán muchos recursos. (Nótese que en esta opción 1 mes equivale a 28 días, en tanto que en los gráficos e informes generados, 1 mes equivale a 1 mes de calendario).', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2095', 'es', '3', 'configstatsmaxruntime', 'Stats processing can be quite intensive, so use a combination of this field and the next one to specify when it will run and how long for.', 'El procesamiento estadístico puede ser muy intenso, de modo que conviene combinar este campo y el siguiente para especificar cuándo y durante cuánto tiempo funcionará.', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2096', 'es', '3', 'configstatsmaxruntime2', 'Stats processing can be quite intensive, specify maximum time allowed for gathering of one day of statistics. Maximum number of days processed in one cron execution is 31.', 'El procesamiento de datos estadísticos puede ser muy intenso. Especifique el tiempo máximo permitido para recopilar las estadísticas de un día. El número máximo de días procesados en una ejecución del cron es de 31.', null, '1472076026', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2097', 'es', '3', 'configstatsmaxruntime3', 'This specifies the maximum time allowed to calculate the statistics for one day, bearing in mind that statistics processing can put a big load on the server. The maximum number of days processed in one cron can be specified below.', 'Especifica el tiempo máximo permitido para calcular las estadísticas de un día, teniendo en cuenta que el proceso de datos estadísticos supone una gran carga para el servidor. El número máximo de días procesados en un cron puede especificarse más abajo.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2098', 'es', '3', 'configstatsruntimedays', 'This specifies the maximum number of days processed in each statistics execution. Once the statistics are up-to-date, only one day will be processed, so adjust this value depending of your server load, reducing it if shorter cron executions are needed.', 'Especifica el número máximo de días procesados en cada ejecución estadística. Una vez que las estadísticas estén al día, se procesará sólo un día, así que ajuste este valor en función de la carga del servidor, reduciéndola si es necesario realizar ejecuciones de cron cortas.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2099', 'es', '3', 'configstatsruntimestart', 'What time should the cronjob that does the statistics processing start? Specifying different times is recommended if there are multiple Moodle sites on one server.', '¿En qué momento comenzará a trabajar el cronjob que procesa las estadísticas? Se recomienda indicar distintas horas si existen varios Moodle en el mismo servidor.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2100', 'es', '3', 'configstatsuserthreshold', 'This setting specifies the minimum number of enrolled users for a course to be included in statistics calculations.', 'Este ajuste especifica el número mínimo de usuarios matriculados en un curso para que este valor sear incluidos en los cálculos de las estadísticas.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2101', 'es', '3', 'configstrictformsrequired', 'If enabled, users are prevented from entering a space or line break only in required fields in forms.', 'Si está activado, se impide a los usuarios introducir un espacio en blanco o un salto de línea en los campos obligatorios de los formularios.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2102', 'es', '3', 'configstripalltitletags', 'Uncheck this setting to allow HTML tags in activity and resource names.', 'Desactive esta opción para permitir marcas HTML en los nombres de actividades y recursos.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2103', 'es', '3', 'configsupportemail', 'This email address will be published to users of this site as the one to email when they need general help (for example, when new users create their own accounts).  If this email is left blank then no such helpful email address is supplied.', 'Esta dirección email se publicará a los usuarios del sitio como aquella a la que deberán dirigirse cuando necesiten ayuda de tipo general (por ejemplo, cuando un usuario nuevo crea su propia cuenta). Si se deja en blanco, no se dispondrá de una dirección de ayuda del tipo mencionado.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2104', 'es', '3', 'configsupportname', 'This is the name of a person or other entity offering general help via the support email or web address.', 'Este es el nombre de una persona u otra entidad  que ofrece ayuda general por medio de una dirección email o una página web.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2105', 'es', '3', 'configsupportpage', 'This web address will be published to users of this site as the one to go to when they need general help (for example, when new users create their own accounts).  If this address is left blank then no link will be supplied.', 'Esta dirección email se publicará a los usuarios del sitio como aquella a la que deberán dirigirse cuando necesiten ayuda de tipo general (por ejemplo, cuando un usuario nuevo crea su propia cuenta). Si se deja en blanco, no se suministrará el enlace correspondiente.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2106', 'es', '3', 'configtempdatafoldercleanup', 'Remove temporary data files from the data folder that are older than the selected time.', 'Eliminar ficheros de datos temporales de la carpeta de datos que sean más viejos que la fecha seleccionada.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2107', 'es', '3', 'configthemedesignermode', 'Normally all theme images and style sheets are cached in browsers and on the server for a very long time, for performance. If you are designing themes or developing code then you probably want to turn this mode on so that you are not served cached versions.  Warning: this will make your site slower for all users!  Alternatively, you can also reset the theme caches manually from the Theme selection page.', 'Habitualmente todas las imágenes del tema y hojas de estilo se almacenan en caché en los navegadores y en el servidor durante un tiempo muy largo, para mejorar el rendimiento. Si va a rediseñar los temas o desarrollar código, es probable que desee activar este modo para que no se guarden versiones en la caché. Advertencia: esto hará que su sitio sea más lento para todos los usuarios mientras esté activado. Opcionalmente también puede restablecer la caché manualmente desde la página del selector de temas.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2108', 'es', '3', 'configthemelist', 'Leave this blank to allow any valid theme to be used.  If you want to shorten the theme menu, you can specify a comma-separated list of names here (Don\'t use spaces!).\nFor example:  standard,orangewhite.', 'Deje esta opción en blanco para permitir que se utilice cualquier tema válido. Si quiere acortar el menú de temas, puede especificar una lista de nombres separados por comas (¡No use espacios!). Por ejemplo: standard,orangewhite', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2109', 'es', '3', 'configtimezone', 'This is the default timezone for displaying dates - each user can override this setting in their profile. Cron tasks and other server settings are specified in this timezone. You should change the setting if it shows as \"Invalid timezone\"', 'Aquí puede decidir la zona horaria por defecto. Ésta es la única zona horaria POR DEFECTO para mostrar fechas -cada usuario puede cambiar esta opción en su perfil-. La \"Hora del Servidor\" aquí hará que Moodle tome por defecto la del sistema operativo, pero esa opción en el perfil del usuario lo ajustará a la correspondiente zona horaria.', null, '1472076027', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2110', 'es', '3', 'configuseblogassociations', 'Should users be able to organize their blog by associating entries with courses and course modules?', '¿Deberían los usuarios poder organizar su blog asociando entradas con los cursos y con los módulos de curso?', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2111', 'es', '3', 'configuseexternalyui', 'Instead of using local files, use online files available on Yahoo&#145;s servers. WARNING: This requires an internet connection, or no AJAX will work on your site. This setting is not compatible with sites using https.', 'En lugar de usar archivos locales, usar archivos disponibles en línea en servidores Yahoo&#145;s. ADVERTENCIA: Esto requiere una conexión de internet; de otro modo, AJAX no funcionará en el sitio.', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2112', 'es', '3', 'configusesitenameforsitepages', 'If enabled the site\'s shortname will be used for the site pages node in the navigation rather than the string \'Site pages\'', 'Si está habilitado se utilizará el nombre corto del sitio en lugar de la cadena de texto \'páginas del sitio\' en la navegación por las páginas del sitio', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2113', 'es', '3', 'configusetags', 'Should tags functionality across the site be enabled?', '¿Habilitar la funcionalidad de marcas a través del sitio?', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2114', 'es', '3', 'configvariables', 'Variables', 'Variables', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2115', 'es', '3', 'configverifychangedemail', 'Enables verification of changed email addresses using allowed and denied email domains settings. If this setting is disabled the domains are enforced only when creating new users.', 'Habilita la verificación de direcciones de email cambiadas usando ajustes de dominios de correo electrónico permitidos y denegados. Si esta opción está deshabilitada, los dominios se fuerzan sólo cuando se crean usuarios nuevos.', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2116', 'es', '3', 'configvisiblecourses', 'Display courses in hidden categories normally', 'Mostrar normalmente los cursos de categorías ocultas', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2117', 'es', '3', 'configwarning', 'Be careful modifying these settings - strange values could cause problems.', 'Sea cuidadoso al modificar estos resultados (valores extraños pueden ocasionar problemas).', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2118', 'es', '3', 'configyuicomboloading', 'This options enables combined file loading optimisation for YUI libraries. This setting should be enabled on production sites for performance reasons.', 'Esta opción permite la optimización de carga de archivos de bibliotecas YUI. Esta opción debe estar habilitada en los centros de producción por razones de rendimiento.', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2119', 'es', '3', 'confirmation', 'Confirmation', 'Confirmación', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2120', 'es', '3', 'confirmdeletecomments', 'You are about to delete comments, are you sure?', 'Está a punto de eliminar comentarios, ¿está seguro?', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2121', 'es', '3', 'confirmed', 'Confirmed', 'Confirmado', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2122', 'es', '3', 'cookiehttponly', 'Only http cookies', 'Sólo \'cookies\' http', null, '1472076028', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2123', 'es', '3', 'cookiesecure', 'Secure cookies only', 'Sólo \'cookies\' seguras', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2124', 'es', '3', 'country', 'Default country', 'País por defecto', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2125', 'es', '3', 'coursecontact', 'Course contacts', 'Gestores de curso', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2126', 'es', '3', 'coursecontact_desc', 'This setting allows you to control who appears on the course description. Users need to have at least one of these roles in a course to be shown on the course description for that course.', 'Esta opción le permite controlar quién aparece en la descripción del curso. Los usuarios deben tener al menos uno de estos roles en un curso a fin de poder mostrarlos en la descripción de ese curso.', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2127', 'es', '3', 'courselistshortnames', 'Display extended course names', 'Mostrar nombres extendidos del curso', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2128', 'es', '3', 'courselistshortnames_desc', 'If enabled, course short names will be displayed in addition to full names in course lists. If required, extended course names may be customised by editing the \'courseextendednamedisplay\' language string using the language customisation feature.', 'Si está activado, en las listas de cursos se mostrarán los nombres cortos además de los nombres largos. Si es necesario, los nombres largos de los cursos pueden personalizarse editando la cadena \"courseextendednamedisplay\" utilizando la función de personalización de idioma.', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2129', 'es', '3', 'coursemgmt', 'Manage courses and categories', 'Administrar cursos y categorías', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2130', 'es', '3', 'courseoverview', 'Course overview', 'Vista general del curso', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2131', 'es', '3', 'courserequestnotify', 'Course request notification', 'Notificación de solicitud de curso', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2132', 'es', '3', 'courserequestnotifyemail', 'User {$a->user} requested a new course at {$a->link}', 'El usuario {$a->user} ha solicitado un nuevo curso en {$a->link}', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2133', 'es', '3', 'courserequests', 'Course requests', 'Solicitudes de cursos', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2134', 'es', '3', 'courserequestspending', 'Pending course requests', 'Solicitudes de curso pendientes', null, '1472076029', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2135', 'es', '3', 'courses', 'Courses', 'Cursos', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2136', 'es', '3', 'coursesperpage', 'Courses per page', 'Cursos por página', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2137', 'es', '3', 'courseswithsummarieslimit', 'Courses with summaries limit', 'Cursos con límite de resúmenes', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2138', 'es', '3', 'creatornewroleid', 'Creators\' role in new courses', 'Rol de los creadores en cursos nuevos', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2139', 'es', '3', 'creatornewroleid_help', 'If the user does not already have the permission to manage the new course, the user is automatically enrolled using this role.', 'Si el usuario no tiene aún permiso para administrar el nuevo curso, el usuario es matriculado  automáticamente utilizando este rol.', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2140', 'es', '3', 'cron', 'Cron', 'Cron', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2141', 'es', '3', 'cron_help', 'The cron.php maintenance script assists some of Moodle\'s modules to perform tasks on a scheduled basis, such as mailing out copies of new forum posts. A mechanism is required to run the script regularly e.g. every 5 minutes.', 'El script de mantenimiento cron.php es requerido por algunos de los módulos de Moodle para realizar tareas de forma programada tales como enviar por correo la copia de los nuevos mensajes de los foros. Es necesario ejecutar, mediante algún mecanismo programado, la secuencia de comandos que ejecute la acción de cron.php periódicamente, por ejemplo cada 5 minutos.', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2142', 'es', '3', 'cron_link', 'admin/cron', 'admin/cron', null, '1472076030', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2143', 'es', '3', 'cronclionly', 'Cron execution via command line only', 'Ejecución de cron sólo mediante comandos', null, '1472076030', null, '0', '0');
