INSERT INTO `mdl_tool_customlang` VALUES ('2149', 'es', '3', 'ctyperequired', 'The ctype PHP extension is now required by Moodle, in order to improve site performance and to offer multilingual compatibility.', 'Con el fin de mejorar el rendimiento del sitio y ofrecer compatibilidad multilingüe, Moodle requiere la extensión ctype de PHP.', null, '1472076030', null, '0', '0');
