INSERT INTO `mdl_tool_customlang` VALUES ('2152', 'es', '3', 'curltimeoutkbitrate', 'Bitrate to use when calculating cURL timeouts (Kbps)', 'Velocidad de transmisión a utilizar cuando se calculan los tiempos de expiración de cURL (Kbps)', null, '1472076031', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2153', 'es', '3', 'curltimeoutkbitrate_help', 'This setting is used to calculate an appropriate timeout during large cURL requests. As part of this calculation an HTTP HEAD request is made to determine the size of the content. Setting this to 0 disables this request from being made.', 'Este ajuste se usa para calcular un tiempo de expiración apropiado para las solicitudes cURL grandes. Como parte del cálculo se hace una petición HTTP HEAD para determinar el tamaño del contenido. Ajustar este valor a 0 deshabilita que se haga esta solicitud.', null, '1472076031', null, '0', '0');
