INSERT INTO `mdl_tool_customlang` VALUES ('2173', 'es', '3', 'debugstringids_desc', 'This option is designed to help translators. When this option is enabled, if you add the parameter strings=1 to a request URL, it will show the language file and string id beside each string that is output.', 'Esta opción está diseñada para ayudar a los traductores. Cuando esta opción está activada, si se agrega el parámetro strings = 1 para una petición de URL, se mostrará el archivo de idioma y el identificador de cadena al lado de cada cadena que se emite.', null, '1472076032', null, '0', '0');
