INSERT INTO `mdl_tool_customlang` VALUES ('2188', 'es', '3', 'devicedetectregex', 'Device detection regular expressions', 'Expresiones regulares para la detección de dispositivos', null, '1472076034', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2189', 'es', '3', 'devicedetectregex_desc', '<p>By default, Moodle can detect devices of the type default (desktop PCs, laptops, etc), mobile (phones and small hand held devices), tablet (iPads, Android tablets) and legacy (Internet Explorer 6 users).  The theme selector can be used to apply separate themes to all of these.  This setting allows regular expressions that allow the detection of extra device types (these take precedence over the default types).</p>\n<p>For example, you could enter the regular expression \'/(MIDP-1.0|Maemo|Windows CE)/\' to detect some commonly used feature phones add the return value \'featurephone\'.  This adds \'featurephone\' on the theme selector that would allow you to add a theme that would be used on these devices.  Other phones would still use the theme selected for the mobile device type.</p>', '<p>Por defecto Moodle puede detectar dispositivos del tipo \'por defecto\' (PC de escritorio, PC portátil, etc.) dispositivos móviles (teléfonos y pequeños dispositivos como PDAs), tabletas (iPads, tabletas Android) y \'heredados\' (usuarios de Internet Explorer 6). Se puede usar el selector de temas para aplicar temas diferentes a cada uno de ellos. Este ajuste admite expresiones regulares que permiten detectar tipos de dispositivos extra (éstos tienen precedencia sobre los tipos por defecto).</p><p>Por ejemplo, podría introducir la expresión regular \'/(MIDP-1.0|Maemo|Windows CE)/\' para detectar algunos teléfonos usados habitualmente con determinada característica y añadir el valor \'telefonocaracteristica\'. Esto añade \'telefonocaracteristica\' en el selector de temas, lo que permite añadir un tema para usarse con estos dispositivos. El resto de teléfonos seguirán usando el tema seleccionado para los tipos de dispositivos móviles.</p>', null, '1472076034', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2190', 'es', '3', 'devicedetectregexexpression', 'Regular expression', 'Expresión regular', null, '1472076034', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2191', 'es', '3', 'devicedetectregexvalue', 'Return value', 'Valor devuelto', null, '1472076034', null, '0', '0');
