INSERT INTO `mdl_tool_customlang` VALUES ('2228', 'es', '3', 'enablecssoptimiser_desc', 'When enabled CSS will be run through an optimisation process before being cached. The optimiser processes the CSS removing duplicate rules and styles, as well as white space removable and reformatting. Please note turning this on at the same time as theme designer mode is awful for performance but will help theme designers create optimised CSS.', 'Cuando se habilita, CSS se someterá a un proceso de optimización antes de guardar en cache. El optimizador procesa el CSS y remueve las reglas duplicadas y los estilos duplicados, al igual que el espacio blanco removible y recompone el formato. Por favor observe que activar esta opción al mismo tiempo que el modo de diseño de temas gráficos será malísimo para el desempeño, pero les ayudará a los diseñadores de los temas gráficos para crear CSS optimizado.', null, '1472076038', null, '0', '0');
