INSERT INTO `mdl_tool_customlang` VALUES ('2310', 'es', '3', 'googlemapkey3_help', 'You need to enter a special key to use Google Maps for IP address lookup visualization. You can obtain the key free of charge at <a href=\"https://developers.google.com/maps/documentation/javascript/tutorial#api_key\" target=\"_blank\">https://developers.google.com/maps/documentation/javascript/tutorial#api_key</a>', 'Necesita introducir una clave especial para utilizar Google Maps para visualizar la búsqueda de la dirección IP. Puede obtener dicha clave gratuitamente en <a href=\"https://developers.google.com/maps/documentation/javascript/tutorial#api_key\" target=\"_blank\">https://developers.google.com/maps/documentation/javascript/tutorial#api_key</a>', null, '1472076046', null, '0', '0');
