INSERT INTO `mdl_tool_customlang` VALUES ('2318', 'es', '3', 'guestroleid_help', 'This role is automatically assigned to the guest user. It is also temporarily assigned to not enrolled users that enter the course via guest enrolment plugin.', 'Este rol se le asigna automáticamente a los invitados. También se asigna, temporalmente, por medio del plugin de matriculación de invitados a los usuarios que no están inscritos en un curso.', null, '1472076047', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2319', 'es', '3', 'helpadminseesall', 'Do admins see all calendar events or just those that apply to themselves?', '¿Pueden los administradores ver todos los eventos del calendario o sólo los que les conciernen?', null, '1472076047', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2320', 'es', '3', 'helpcalendarcustomexport', 'Enable custom date range export option in calendar exports. Calendar exports must be enabled before this is effective.', 'Habilitar la opción de periodo personalizado en las exportaciones del calendario. Las opciones de exportación del calendario deben estar activas para que sea efectivo.', null, '1472076047', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2321', 'es', '3', 'helpexportlookahead', 'How many days in the future does the calendar look for events during export for the custom export option?', '¿Cuántos días hacia delante buscará el calendario de eventos durante la exportación en la opción de exportación personalizada?', null, '1472076047', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2322', 'es', '3', 'helpexportlookback', 'How many days in the past does the calendar look for events during export for the custom export option?', '¿Cuántos días hacia atrás buscará el calendario de eventos durante la exportación en la opción de exportación personalizada?', null, '1472076047', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2323', 'es', '3', 'helpforcetimezone', 'You can allow users to individually select their timezone, or force a timezone for everyone.', 'Puede permitir que los usuarios seleccionen su zona horaria, o forzarla para todos.', null, '1472076047', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2324', 'es', '3', 'helpshowicalsource', 'If enabled, the subscription name and link will be shown for iCal-imported events.', 'Si está habilitado, se mostrará el nombre de la suscripción y el enlace de los eventos iCal-importados.', null, '1472076047', null, '0', '0');
