INSERT INTO `mdl_tool_customlang` VALUES ('2350', 'es', '3', 'installsessionerror', 'Can not initialise PHP session, please verify that your browser accepts cookies.', 'No se puede inicializar sesión de PHP, por favor, verifique que su navegador acepta \'cookies\'.', null, '1472076049', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2351', 'es', '3', 'intlrecommended', 'Intl extension is used to improve internationalization support, such as locale aware sorting.', 'La extensión internacional se utiliza para mejorar el soporte a la internacionalización, como en el caso de la ordenación de localidades.', null, '1472076049', null, '0', '0');
