INSERT INTO `mdl_tool_customlang` VALUES ('2371', 'es', '3', 'legacyfilesaddallowed', 'Allow adding to legacy course files', 'Permitir añadir a archivos de curso heredados', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2372', 'es', '3', 'legacyfilesaddallowed_help', 'If a course has legacy course files, allow new files and folders to be added to it.', 'Si un curso tiene archivos de curso heredados, permitir agregarle nuevos archivos y carpeta', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2373', 'es', '3', 'legacyfilesinnewcourses', 'Legacy course files in new courses', 'Archivos heredados en los cursos nuevos', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2374', 'es', '3', 'legacyfilesinnewcourses_help', 'By default, legacy course files areas are available in upgraded courses only. Please note that some features such as activity backup and restore are not compatible with this setting.', 'De forma predeterminada los archivos heredados sólo están disponibles en los cursos actualizados desde versiones anteriores de Moodle (1.9.x a 2.0 por ejemplo). Tenga en cuenta que algunas características como la copia de seguridad y la restauración no son compatibles con esta configuración.', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2375', 'es', '3', 'licensesettings', 'Licence settings', 'Configuración de licencias', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2376', 'es', '3', 'linkadmincategories', 'Link admin categories', 'Enlace al administrador de categorías', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2377', 'es', '3', 'linkadmincategories_help', 'If enabled admin setting categories will be displayed as links in the navigation and will lead to the admin category pages.', 'Si se habilita, los parámetros de configuación de las categorías se mostrarán como enlaces en la barra de navegación y cargarán a las páginas de la categoría.', null, '1472076051', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2378', 'es', '3', 'linkcoursesections', 'Always link course sections', 'Enlazar siempre las secciones de los cursos', null, '1472076052', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2379', 'es', '3', 'linkcoursesections_help', 'Always try to provide a link for course sections. Course sections are usually only shown as links if the course format displays a single section per page. If this setting is enabled a link will always be provided.', 'Intenta proporcionar siempre un enlace a la secciones de los cursos. Las secciones de los cursos son mostradas normalmente como enlaces si el formato del curso muestra una sección por página. Si este ajuste está habilitado se mostrará siempre un enlace.', null, '1472076052', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2380', 'es', '3', 'loading', 'Loading', 'Cargando', null, '1472076052', null, '0', '0');
