INSERT INTO `mdl_tool_customlang` VALUES ('2384', 'es', '3', 'locationsettings', 'Location settings', 'Ajustes de ubicación', null, '1472076052', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2385', 'es', '3', 'locked', 'Locked', 'Bloqueado', null, '1472076052', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2386', 'es', '3', 'lockoutduration', 'Account lockout duration', 'Tiempo de duración del bloqueo', null, '1472076052', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2387', 'es', '3', 'lockoutduration_desc', 'Locked out account is automatically unlocked after this duration.', 'La cuenta bloqueada se desbloquea automáticamente después de esta tiempo.', null, '1472076052', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2388', 'es', '3', 'lockoutemailbody', 'Your account with username {$a->username} on server \'{$a->sitename}\'\nwas locked out after multiple invalid login attempts.\n\nTo unlock the account immediately go to the following address\n\n{$a->link}\n\nIn most mail programs, this should appear as a blue link\nwhich you can just click on.  If that doesn\'t work,\nthen copy and paste the address into the address\nline at the top of your web browser window.\n\nIf you need help, please contact the site administrator,\n{$a->admin}', 'Su cuenta de usuario {$a->username} en el sitio \'{$a->sitename}\' ha sido bloqueada tras múltiples intentos de acceso no válidos.\n\nPara desbloquear la cuenta de forma inmediata pulse en el siguiente enlace\n\n{$a->link}\n\nEn la mayoría de programas de correo aparecerá como un enlace en azul sobre el que puede pulsar. Si no funciona, simplemente copie el texto del enlace y péguelo en la barra de direcciones de la parte superior de su navegador web.\n\nSi necesita ayuda, por favor contacte con el administrador del sitio, {$a->admin}', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2389', 'es', '3', 'lockoutemailsubject', 'Your account on {$a} was locked out', 'Su cuenta en {$a} fue bloqueada', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2390', 'es', '3', 'lockouterrorunlock', 'Invalid account unlock information supplied.', 'Suministrada información no válida de bloqueo de cuenta.', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2391', 'es', '3', 'lockoutthreshold', 'Account lockout threshold', 'Umbral de bloqueo de la cuenta', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2392', 'es', '3', 'lockoutthreshold_desc', 'Select number of failed login attempts that result in account lockout. This feature may be abused in denial of service attacks.', 'Seleccione el número de intentos de conexión fallidos que dan como resultado el bloqueo de la cuenta. Esta característica puede ser objeto de abuso en ataques de denegación de servicio.', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2393', 'es', '3', 'lockoutwindow', 'Account lockout observation window', 'Ventana de observación de cuenta bloqueada', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2394', 'es', '3', 'lockoutwindow_desc', 'Observation time for lockout threshold, if there are no failed attempts the threshold counter is reset after this time.', 'Tiempo de observación para el umbral de bloqueo, si no hay intentos fallidos el contador se restablece después de este tiempo.', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2395', 'es', '3', 'log', 'Logs', 'Registros', null, '1472076053', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2396', 'es', '3', 'logguests', 'Log guest access', 'Registro del acceso de invitados', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2397', 'es', '3', 'logguests_help', 'This setting enables logging of actions by guest account and not logged in users. High profile sites may want to disable this logging for performance reasons. It is recommended to keep this setting enabled on production sites.', 'Esta configuración habilita el registro de acciones para cuentas de invitados o usuarios no registrados. En determinados sitios se podría desactivar esta opción por razones de rendimiento. Se recomienda mantener esta opción habilitada en los sitios en producción.', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2398', 'es', '3', 'loginhttps', 'Use HTTPS for logins', 'Usar HTTPS para accesos', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2399', 'es', '3', 'loginpageautofocus', 'Autofocus login page form', 'Formulario de página de enfoque automático de inicio de sesión', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2400', 'es', '3', 'loginpageautofocus_help', 'Enabling this option improves usability of the login page, but automatically focusing fields may be considered an accessibility issue.', 'Al activar esta opción se mejora la usabilidad de la página de identificación de usuario, pero el enfoque automático de campos puede ser considerado como un problema de accesibilidad.', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2401', 'es', '3', 'loginpasswordautocomplete', 'Prevent password autocompletion on login form', 'Evita que la contraseña se autocomplete en el formulario de acceso', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2402', 'es', '3', 'loginpasswordautocomplete_help', 'If enabled, users are not allowed to save their account password in their browser.', 'Si está activa, los usuarios no podrán', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2403', 'es', '3', 'loglifetime', 'Keep logs for', 'Mantener registros para', null, '1472076054', null, '0', '0');
