INSERT INTO `mdl_tool_customlang` VALUES ('2405', 'es', '3', 'logstoressupported', 'Log stores that support this report', 'Almacenes de registro que dan soporte a este informe', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2406', 'es', '3', 'longtimewarning', '<b>Please note that this process can take a long time.</b>', '<b>Por favor, tenga en cuenta que este proceso puede durar mucho.</b>', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2407', 'es', '3', 'maintenancemode', 'In maintenance mode', 'En Modo Mantenimiento', null, '1472076054', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2408', 'es', '3', 'maintenancemodeisscheduled', 'This site will be switched to maintenance mode in {$a->min} mins {$a->sec} secs', 'Este sitio entrará en modo mantenimiento en {$a->min} minutos y {$a->sec} segundos', null, '1472076055', null, '0', '0');
