INSERT INTO `mdl_tool_customlang` VALUES ('2421', 'es', '3', 'maturityallowunstable', 'Hint: You may want to run this script with --allow-unstable option', 'Sugerencia: Es posible que desee ejecutar este script con la opción - \"allow-inestable\"', null, '1472076056', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2422', 'es', '3', 'maturitycoreinfo', 'Your site is currently running unstable \"{$a}\" development code.', 'Su sitio está actualmente en código de desarrollo \"{$a}\" y podría ser inestable.', null, '1472076056', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2423', 'es', '3', 'maturitycorewarning', 'The version of Moodle that you are about to install or upgrade to contains\nunstable \"{$a}\" development code that is not suitable for use on most production\nsites. If this is not what you wanted then you should make sure you are updating\nfrom a STABLE branch of the Moodle code. See Moodle Docs for more details.', 'La versión de Moodle que usted va a instalar o actualizar contiene código de desarrollo \"{$a}\" que no es adecuada para usarse en la mayoría de los sitios de producción. Si no es esto lo que desea entonces debería asegurarse de que instala o actualiza una versión de una rama \"STABLE\" del código de Moodle. Vea Moodle Docs para más detalles.', null, '1472076056', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2424', 'es', '3', 'maxbytes', 'Maximum uploaded file size', 'Tamaño máximo del archivo subido', null, '1472076056', null, '0', '0');
