INSERT INTO `mdl_tool_customlang` VALUES ('2427', 'es', '3', 'maxusersperpage', ' Maximum users per page', 'Número máximo de usuarios por página', null, '1472076057', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2428', 'es', '3', 'configmaxusersperpage', 'Maximum number of users displayed within user selector in course, group, cohort, webservice etc.', 'Número máximo de cursos que se mostrará en la página principal del sitio en los listados de cursos.', null, '1472076057', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2429', 'es', '3', 'mbstringrecommended', 'Installing the optional MBSTRING library is highly recommended in order to improve site performance, particularly if your site is supporting non-Latin languages.', 'La instalación de la librería opcional MBSTRING es muy recomendable para mejorar el rendimiento del sitio, especialmente si su sitio está soportando idiomas no latinos.', null, '1472076057', null, '0', '0');
