INSERT INTO `mdl_tool_customlang` VALUES ('2456', 'es', '3', 'mnetrestore_extusers', '<strong>Note:</strong> This backup file contains remote Moodle Network user accounts which will be restored as part of the process.', 'Esta copia de seguridad contiene cuentas de usuario de red Moodle remotas las cuales serán recuperadas como parte del proceso.', null, '1472076059', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2457', 'es', '3', 'mnetrestore_extusers_admin', '<strong>Note:</strong> This backup file seems to come from a different Moodle installation and contains remote Moodle Network user accounts. The restore process will try to match the Moodle Network hosts for all created users. Those not matching will be automatically switched to internal authentication (instead of mnet one). The restore log will inform you about that.', '<strong> Nota: </ strong> Este archivo de copia de seguridad parece venir de otro de instalación de Moodle y contiene cuentas de usuario de Moodle Network. El proceso de restauración intentará hacer coincidir los host de Moodle Network con todos los usuarios creados. Los que no coincidan se conectarán automáticamente mediante identificación interna (en lugar de la de Mnet). El informe de restauración le informará al respecto.', null, '1472076060', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2458', 'es', '3', 'mnetrestore_extusers_mismatch', '<strong>Note:</strong> This backup file apparently originates from a different Moodle installation and contains remote Moodle Network user accounts that may fail to restore. This operation is unsupported. If you are certain that it was created on this Moodle installation, or you can ensure that all the needed Moodle Network Hosts are configured, you may want to still try the restore.', '<strong>Nota:</strong> Esta copia de seguridad aparentemente se origina de una instalación diferente de Moodle y contiene cuentas de red Moodle remotas que se puede fallar en recuperar. Esta operación no es admitida. Si usted está seguro que fue creada en esta instalación de Moodle, o puede asegurarse de que todos los hosts de red Moodle necesarios están configurados, podría intentar la restauración.', null, '1472076060', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2459', 'es', '3', 'mnetrestore_extusers_noadmin', '<strong>Note:</strong> This backup file seems to come from a different Moodle installation and contains remote Moodle Network user accounts. You are not allowed to execute this type of restore. Contact the administrator of the site or, alternatively, restore this course without any user information (modules, files...)', '<strong> Nota: </ strong> Este archivo de copia de seguridad parece venir de otra instalación de Moodle y contiene cuentas de usuario de  Moodle Network. No tiene permiso para ejecutar este tipo de restauración. Póngase en contacto con el administrador del sitio o bien,  restaure este curso sin ningún tipo de información de usuario (módulos, archivos ...)', null, '1472076060', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2460', 'es', '3', 'mnetrestore_extusers_switchuserauth', 'Remote Moodle Network user {$a->username} (coming from {$a->mnethosturl}) switched to local {$a->auth} authenticated user.', 'El usuario remoto de Moodle Network {$a->username} (proveniente de {$a->mnethosturl}) ha cambiado a usuario identificado {$a->auth} local.', null, '1472076060', null, '0', '0');
