INSERT INTO `mdl_tool_customlang` VALUES ('2466', 'es', '3', 'modeditingmenu_desc', 'If enabled many of the activity editing icons shown when viewing a course with editing on will be displayed within a drop-down menu. This reduces the content on screen when editing a course by hiding the icons until they are needed.', 'Si se activa muchos de los iconos de edición de la actividad que se muestran al visualizar un curso en modo de edición se mostrará dentro de un menú desplegable. Esto optimiza el uso de la pantalla durante la edición de un curso al ocultar los iconos hasta que se necesiten.', null, '1472076060', null, '0', '0');
