INSERT INTO `mdl_tool_customlang` VALUES ('2478', 'es', '3', 'navadduserpostslinks', 'Add links to view user posts', 'Añada enlaces para ver los mensajes del usuario', null, '1472076061', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2479', 'es', '3', 'navadduserpostslinks_help', 'If enabled two links will be added to each user in the navigation to view discussions the user has started and posts the user has made in forums throughout the site or in specific courses.', 'Si está habilitado, dos enlaces se añadirán a la navegación del usuario  para ver las discusiones que el usuario ha comenzado y los mensajes que el usuario ha hecho en foros en todo el sitio o en cursos específicos.', null, '1472076061', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2480', 'es', '3', 'navigationupgrade', 'This upgrade introduces two new navigation blocks that will replace these blocks: Administration, Courses, Activities and Participants.  If you had set any special permissions on those blocks you should check to make sure everything is behaving as you want it.', 'Esta actualización introduce dos nuevos bloques de navegación que sustituirán a estos bloques: Administración, Cursos, Actividades y Participantes. Si tiene establecido algún permiso especial en estos  bloques debe asegurarse de que todo se está comportando como usted desea.', null, '1472076061', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2481', 'es', '3', 'navcourselimit', 'Course limit', 'Límite del curso', null, '1472076061', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2482', 'es', '3', 'navexpandmycourses', 'Show My courses expanded on Dashboard', 'Mostrar Mis cursos expandidos en el Área personal', null, '1472076061', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2483', 'es', '3', 'navexpandmycourses_desc', 'If enabled, My courses is initially shown expanded in the navigation block on Dashboard.', 'Si se habilita, Mis cursos se muestran inicialmente expandidos en el bloque de navegación del Área personal.', null, '1472076061', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2484', 'es', '3', 'navshowfullcoursenames', 'Show course full names', 'Ver nombres completos de curso', null, '1472076062', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2485', 'es', '3', 'navshowfullcoursenames_help', 'If enabled, course full names will be used in the navigation rather than short names.', 'Si se habilita, el nombre completo de los cursos se mostrarán en los elementos de navegación en lugar de sus nombres cortos.', null, '1472076062', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2486', 'es', '3', 'navshowfrontpagemods', 'Show front page activities in the navigation', 'Mostrar actividades de la página principal en la navegación', null, '1472076062', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2487', 'es', '3', 'navshowfrontpagemods_help', 'If enabled, front page activities will be shown on the navigation under site pages.', 'Si se activa, las actividades de la página de portada se mostrarán en la navegación debajo de las páginas del sitio.', null, '1472076062', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2488', 'es', '3', 'navshowallcourses', 'Show all courses', 'Mostrar todos los cursos', null, '1472076062', null, '0', '0');
