INSERT INTO `mdl_tool_customlang` VALUES ('2490', 'es', '3', 'navshowmycoursecategories', 'Show my course categories', 'Mostrar mis categorías de curso', null, '1472076062', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2491', 'es', '3', 'navshowmycoursecategories_help', 'If enabled courses in the users my courses branch will be shown in categories.', 'Si se habilita, los cursos mostrados en la opción de menú \"Mis cursos\" se mostrarán en categorías', null, '1472076062', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2492', 'es', '3', 'navsortmycoursessort', 'Sort my courses', 'Ordenar mis cursos', null, '1472076062', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2493', 'es', '3', 'navsortmycoursessort_help', 'This determines whether courses are listed under My courses according to the sort order (i.e. the order set in Site administration > Courses > Manage courses and categories) or alphabetically by course setting.', 'Determina cómo se mostrarán los cursos que aparecen dentro de la rama de mis cursos en la navegación. Por  defecto se utiliza el criterio de ordenación.', null, '1472076063', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2494', 'es', '3', 'neverdeleteruns', 'Never delete runs', 'Nunca eliminar ejecuciones', null, '1472076063', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2495', 'es', '3', 'nobookmarksforuser', 'You do not have any bookmarks.', 'No tiene ninguna marca.', null, '1472076063', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2496', 'es', '3', 'nodatabase', 'No database', 'Ninguna base de datos', null, '1472076063', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2497', 'es', '3', 'nohttpsformobilewarning', 'It is recommended to enable HTTPS with a valid certificate. The Moodle app will always try to use a secured connection first.', 'Se recomienda que se habilite HTTPS con un certificado válido. La aplicación Moodle siempre intentará usar una conexión segura en primer lugar.', null, '1472076063', null, '0', '0');
