INSERT INTO `mdl_tool_customlang` VALUES ('2500', 'es', '3', 'nonexistentbookmark', 'The bookmark you requested does not exist.', 'La marca solicitada no existe.', null, '1472076063', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2501', 'es', '3', 'nosupportedlogstore', 'No supported logstore found', 'Sin soporte para el tipo de almacenamiento de registros encontrado', null, '1472076063', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2502', 'es', '3', 'maxtimelimit', 'Maximum time limit', 'Límite de tiempo máximo', null, '1472076063', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2503', 'es', '3', 'maxtimelimit_desc', 'To restrict the maximum PHP execution time that Moodle will allow without any output being displayed, enter a value in seconds here. 0 means that Moodle default restrictions are used. If you have a front-end server with its own time limit, set this value lower to receive PHP errors in logs. Does not apply to CLI scripts.', 'Para restringir el tiempo máximo de ejecución de PHP que Moodle permitirá sin que se muestre ninguna salida, introduzca aquí un valor en segundos. 0 significa que se utilizan restricciones predeterminadas de Moodle. Si dispone de un servidor front-end con su propio límite de tiempo, establezca este valor más bajo para recibir errores de PHP en los logs. No se aplica a los scripts de CLI.', null, '1472076063', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2504', 'es', '3', 'noresults', 'No results found.', 'No hay resultados.', null, '1472076063', null, '0', '0');
