INSERT INTO `mdl_tool_customlang` VALUES ('2520', 'es', '3', 'passwordchangelogout', 'Log out after password change', 'Cerrar sesión después de cambiar la contraseña', null, '1472076064', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2521', 'es', '3', 'passwordchangelogout_desc', 'If enabled, when a password is changed, all browser sessions are terminated, apart from the one in which the new password is specified. (This setting does not affect password changes via bulk user upload.)', 'Si se activa, cuando la clave sea modificada todas las sesiones del navegador serán terminadas, a excepción de en la que se ha introducido la nueva contraseña. (Este ajuste no afecta a los cambios realizados vía subida masiva de usuarios.)', null, '1472076064', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2522', 'es', '3', 'passwordpolicy', 'Password policy', 'Política de contraseñas', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2523', 'es', '3', 'passwordresettime', 'Maximum time to validate password reset request', 'Tiempo máximo para validar una solicitud de restablecimiento de contraseña', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2524', 'es', '3', 'passwordreuselimit', 'Password rotation limit', 'Límite de rotación de contraseñas', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2525', 'es', '3', 'passwordreuselimit_desc', 'Number of times a user must change their password before they are allowed to reuse a password. Hashes of previously used passwords are stored in local database table. This feature might not be compatible with some external authentication plugins.', 'Número de veces que un usuario puede cambiar su contraseña antes de que se le permita reutilizar una contraseña. Los hashes de las contraseñas utilizadas anteriormente son almacenados en una tabla de la base de datos local. Esta opción puede no ser compatible con algunos plugins de autentificación externos.', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2526', 'es', '3', 'pathtodot', 'Path to dot', 'Ruta a dot', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2527', 'es', '3', 'pathtodot_help', 'Path to dot. Probably something like /usr/bin/dot. To be able to generate graphics from DOT files, you must have installed the dot executable and point to it here. Note that, for now, this only used by the profiling features (Development->Profiling) built into Moodle.', 'Ruta hasta el ejecutable de dot. Probablemente algo como /usr/bin/dot. Para ser capaz de generar gráficos a partir de ficheros DOT necesita tener instalado el ejecutable de dot (de las utilidades Graphviz) y apuntar al mismo desde aquí. Note que por ahora solo lo usan las características de perfilado (Desarrollo->Perfilado) incorporadas en Moodle.', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2528', 'es', '3', 'pathtodu', 'Path to du', 'Ruta a du', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2529', 'es', '3', 'pathtogs', 'Path to ghostscript', 'Ruta del ghostcript', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2530', 'es', '3', 'pathtogs_help', 'On most Linux installs, this can be left as \'/usr/bin/gs\'. On Windows it will be something like \'c:\\gs\\bin\\gswin32c.exe\' (make sure there are no spaces in the path - if necessary copy the files \'gswin32c.exe\' and \'gsdll32.dll\' to a new folder without a space in the path)', 'En la mayoría de instalaciones de Linux, puede dejarse como \'/usr/bin/gs\'. En Windows sería algo similar a \'c:gsbingswin32c.exe\' (asegúrese que no existen espacios en la ruta - si es necesario copie los ficheros \'gswin32c.exe\' y \'gsdll32.dll\' a una nueva carpeta sin espacios en su ruta)', null, '1472076065', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2531', 'es', '3', 'pathtopgdump', 'Path to pg_dump', 'Ruta a pg_dump', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2532', 'es', '3', 'pathtopgdumpdesc', 'This is only necessary to enter if you have more than one pg_dump on your system (for example if you have more than one version of postgresql installed)', 'Sólo es necesario entrar si usted tiene má de un pg_dump en su sistema (por ejemplo, si tiene instalada más de una versión de postgresql)', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2533', 'es', '3', 'pathtopgdumpinvalid', 'Invalid path to pg_dump - either wrong path or not executable', 'Ruta no válida a pg_dump: o bien es errónea, o bien no es ejecutable', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2534', 'es', '3', 'pathtopsql', 'Path to psql', 'Ruta a psql', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2535', 'es', '3', 'pathtopsqldesc', 'This is only necessary to enter if you have more than one psql on your system (for example if you have more than one version of postgresql installed)', 'Esto sólo es necesario si tiene más de un psql en su sistema (por ejemplo, si tiene instalada más de una versión de postgresql)', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2536', 'es', '3', 'pathtopsqlinvalid', 'Invalid path to psql - either wrong path or not executable', 'Ruta a psql no válida: o bien es errónea, o bien no es ejecutable', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2537', 'es', '3', 'pathtounoconv', 'Path to unoconv document converter', 'Ruta del conversor de documentos unoconv', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2538', 'es', '3', 'pathtounoconv_help', 'Path to unoconv document converter. This is an executable that is capable of converting between document formats supported by LibreOffice. This is optional, but if specified, Moodle will use it to automatically convert between document formats. This is used to support a wider range of input files for the assignment annotate PDF feature.', 'Ruta del conversor de documentos unoconv. Se trata de un ejecutable que es capaz de convertir formatos de documento soportados por LibreOffice. Es opcional, pero si se especifica, Moodle lo usará para convertir automáticamente entre formatos de documentos. Se utiliza para dar soporte a un rango más amplio de tipos de ficheros que se usan con la herramienta de \"Anotación PDF\" de las Tareas.', null, '1472076066', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2539', 'es', '3', 'pcreunicodewarning', 'It is strongly recommended to use PCRE PHP extension that is compatible with Unicode characters.', 'Se recomienda encarecidamente usar la extensión PCRE PHP que sea compatible con caracteres Unicode.', null, '1472076066', null, '0', '0');
