INSERT INTO `mdl_tool_customlang` VALUES ('2543', 'es', '3', 'pgclusterdescription', 'PostgreSQL version/cluster parameter for command line operations. If you only have one postgresql on your system or you are not sure what this is, leave this blank.', 'Parámetro de versión/cluster PostgreSQL para operaciones de línea de comandos. Si sólo tiene un postgresql en su sistema o no está seguro de qué es esto, déjelo en blanco.', null, '1472076067', null, '0', '0');
