INSERT INTO `mdl_tool_customlang` VALUES ('2545', 'es', '3', 'pleaserefreshregistration', 'Your site is registered. Registration last updated {$a}.<br />The \'Site registration\' scheduled task keeps your registration up to date. You can also manually update your registration at any time.', 'Su sitio ha sido registrado en moodle.org. Por favor, considere la conveniencia de actualizar el registro si hubiera ocurrido algún cambio desde su última actualización en {$a}', null, '1472076067', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2546', 'es', '3', 'pleaserefreshregistrationunknown', 'Your site has been registered but the registration date is unknown. Please update your registration using the \'Update registration\' button or ensure that the \'Site registration\' scheduled task is enabled so your registration is automatically updated.', 'Su sitio ha sido registrado pero la fecha del registro es desconocida. Por favor actualice su registro utilizando el botón \"Actualizar registro\" o compruebe que la tarea programada \"Registro de Sitio\" está habilitada para que su registro se actualice automáticamente.', null, '1472076067', null, '0', '0');
