INSERT INTO `mdl_tool_customlang` VALUES ('2578', 'es', '3', 'profilefieldlink_help', 'To transform the text into a link, enter a URL containing $$, where $$ will be replaced with the text. For example, to transform a Twitter ID to a link, enter http://twitter.com/$$.', 'Para transformar el texto en un enlace, introduzca una URL que contenga $$, donde $$ se sustituye por el texto. Por ejemplo, para transformar una ID de Twitter en un enlace, introduzca http://twitter.com/$$.', null, '1472076069', null, '0', '0');
