INSERT INTO `mdl_tool_customlang` VALUES ('2598', 'es', '3', 'profilesignup', 'Display on signup page?', '¿Mostrar en la página para inscribirse?', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2599', 'es', '3', 'profilespecificsettings', 'Specific settings', 'Ajustes específicos', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2600', 'es', '3', 'profilevisible', 'Who is this field visible to?', '¿Quién puede ver este campo?', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2601', 'es', '3', 'profilevisible_help', '* Not visible - For private data only viewable by administrators\n* Visible to user - For private data only viewable by the user and by administrators\n* Visible to everyone', '<p>Se puede asignar a cada campo personalizado uno de tres ajustes de visibilidad: invisible, a todo el mundo y usuario. El ajuste \'invisible\' normalmente es decidido por un administrador que quiere mantener la privacidad de los datos de los usuarios. El ajuste \'usuario\' es seleccionado normalmente para un campo que contiene información delicada, en tanto que la opción \'todo el mundo\' puede usarse para cualquier tipo de información.</p>', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2602', 'es', '3', 'profilevisibleall', 'Visible to everyone', 'Todos pueden verlo', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2603', 'es', '3', 'profilevisiblenone', 'Not visible', 'No visible', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2604', 'es', '3', 'profilevisibleprivate', 'Visible to user', 'Visible por el usuario', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2605', 'es', '3', 'profiling', 'Profiling', 'Perfilado', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2606', 'es', '3', 'profilingallowall', 'Continuous profiling', 'Perfilado continuo', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2607', 'es', '3', 'profilingallowall_help', 'If you enable this setting, then, at any moment, you can use the PROFILEALL parameter anywhere (PGC) to enable profiling for all the executed scripts along the Moodle session life. Analogously, you can use the PROFILEALLSTOP parameter to stop it.', 'Si habilita este ajuste entonces, en cualquier momento, puede usar el parámetros PROFILEALL en cualquier parte (PGC) para habilitar el perfilado de todos los scripts ejecutados durante la duración de la sesión Moodle. De igual manera, puede usar el parámetro PROFILEALLSTOP para detenerlo.', null, '1472076072', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2608', 'es', '3', 'profilingallowme', 'Selective profiling', 'Perfilado selectivo', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2609', 'es', '3', 'profilingallowme_help', 'If you enable this setting, then, selectively, you can use the PROFILEME parameter anywhere (PGC) and profiling for that script will happen. Analogously, you can use the DONTPROFILEME parameter to prevent profiling to happen', 'Si habilita este ajuste entonces, de forma selectiva, puede usar el parámetro PROFILEME en cualquier parte (PGC) y se habilitará el perfilado para ese script. De igual manera, puede usar el parámetro DONTPROFILEME para evitar que tenga lugar el perfilado.', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2610', 'es', '3', 'profilingautofrec', 'Automatic profiling', 'Perfilado automático', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2611', 'es', '3', 'profilingautofrec_help', 'By configuring this setting, some request (randomly, based on the frequency specified - 1 of N) will be picked and automatically profiled, storing results for further analysis. Note that this way of profiling observes the include/exclude settings. Set it to 0 to disable automatic profiling.', 'Al configurar este ajuste, algunas peticiones (de forma aleatoria, basada en la frecuencia especificada - 1 de cada N) será escogida y perfilada automáticamente, almacenando los resultados para un análisis posterior. Note que esta forma de perfilado respeta los ajustes de inclusion/exclusión. Ponga el valor a 0 para deshabilitar el perfilado automático.', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2612', 'es', '3', 'profilingenabled', 'Enable profiling', 'Habilitar perfiles', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2613', 'es', '3', 'profilingenabled_help', 'If you enable this setting, then profiling will be available in this site and you will be able to define its behavior by configuring the next options.', 'Si habilita este ajuste el perfilado estará disponible en este sitio y podrá definir su comportamiento configurando las siguientes opciones.', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2614', 'es', '3', 'profilingexcluded', 'Exclude profiling', 'Excluir perfiles', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2615', 'es', '3', 'profilingexcluded_help', 'List of (comma separated, absolute skipping wwwroot, callable) URLs that will be excluded from being profiled from the ones defined by \'Profile these\' setting.', 'Lista de URLs (absolutas quitando la parte de wwwroot, llamables, separadas por comas) que se excluirán del perfilado, de entre las definidas en el ajuste \'Perfilar estas\'.', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2616', 'es', '3', 'profilingimportprefix', 'Profiling import prefix', 'Prefijo de la importación de perfiles', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2617', 'es', '3', 'profilingimportprefix_desc', 'For easier detection, all the imported profiling runs will be prefixed with the value specified here.', 'Para una detección más fácil, todas las importaciones de perfiles se prefijan con el valor que aquí se especifica,', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2618', 'es', '3', 'profilingincluded', 'Profile these', 'Perfilar estos', null, '1472076073', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2619', 'es', '3', 'profilingincluded_help', 'List of (comma separated, absolute skipping wwwroot, callable) URLs that will be automatically profiled. Examples: /index.php, /course/view.php. Also accepts the * wildchar at any position. Examples: /mod/forum/*, /mod/*/view.php.', 'Lista de URLs (absolutas quitando la parte de wwwroot, llamables, separadas por comas) que serán perfiladas automáticametne. Ejemplos: /index.php,/course/view.php. También acepta el comodín * en cualquier posición. Ejemplos: /mod/forum/*, /mod/*/view.php.', null, '1472076074', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2620', 'es', '3', 'profilinglifetime', 'Keep profiling runs', 'Mantener perfilado de ejecuciones', null, '1472076074', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2621', 'es', '3', 'profilinglifetime_help', 'Specify the time you want to keep information about old profiling runs. Older ones will be pruned periodically. Note that this excludes any profiling run marked as \'reference run\'.', 'Especifique cuanto tiempo desea mantener la información de anteriores ejecuciones de perfilado. Las más antiguas se eliminarán automáticamente. Note que esto excluye cualquier ejecución de perfilado marcada como \'ejecución de referencia\'.', null, '1472076074', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2622', 'es', '3', 'protectusernames', 'Protect usernames', 'Proteger nombres de usuario', null, '1472076074', null, '0', '0');
