INSERT INTO `mdl_tool_customlang` VALUES ('2631', 'es', '3', 'questioncwqpfscheck', 'One or more \'random\' questions in a quiz are set up to select questions from a mixture of shared and unshared question categories. There is a more detailed report <a href=\"{$a->reporturl}\">here</a> and see Moodle Docs page <a href=\"{$a->docsurl}\">here</a>.', 'Una o más preguntas \'aleatorias\' de un cuestionario se disponen para seleccionar preguntas de una mezcla de categorías de pregunta compartidas y no compartidas. Puede ver un informe más detallado <a href=\"{$a->reporturl}\">aquí</a> o consultar la página de Moodle Docs <a href=\"{$a->docsurl}\">here</a>.', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2632', 'es', '3', 'questioncwqpfsok', 'Good. There are no \'random\' questions in your quizzes that are set up to select questions from a mixture of shared and unshared question categories.', 'Bueno. No existen preguntas \'aleatorias\' en sus cuestionarios que estén ajustadas para seleccionar preguntas a partir de una mezcla de categorías de pregunta compartidas y no compartidas.', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2633', 'es', '3', 'questiontype', 'Question type', 'Tipo de pregunta', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2634', 'es', '3', 'questiontypes', 'Question types', 'Tipos de preguntas', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2635', 'es', '3', 'quizattemptsupgradedmessage', 'In Moodle 2.1 there was a major upgrade to questions. It was possible to delay parts of the database upgrade to be run later. Before upgrading to Moodle 2.7, this upgrade must be completed.', 'En Moodle 2.1 se produjo una importante actualización de preguntas. Fue posible retrasar partes de la actualización de base de datos que se ejecute más tarde. Antes de actualizar a Moodle 2.7, se debe completar la actualización.', null, '1472076075', null, '0', '0');
