INSERT INTO `mdl_tool_customlang` VALUES ('2638', 'es', '3', 'register', 'Register your site', 'Registre su sitio', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2639', 'es', '3', 'registermoodleorg', 'When you register your site', 'Al registrar su sitio', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2640', 'es', '3', 'registermoodleorgli1', 'You are added to a low-volume mailing list for important notifications such as security alerts and new releases of Moodle.', 'Su nombre se ha añadido a una lista de correo de bajo volumen para recibir las notificaciones importantes, como alertas de seguridad  o nuevas versiones de Moodle.', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2641', 'es', '3', 'registermoodleorgli2', 'Statistics about your site will be added to the {$a} of the worldwide Moodle community.', 'Las estadísticas sobre su sitio se incorporarán a la {$a} de la comunidad de Moodle en todo el mundo.', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2642', 'es', '3', 'registerwithmoodleorg', 'Register your site', 'Registre su sitio', null, '1472076075', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2643', 'es', '3', 'registration', 'Registration', 'Registro', null, '1472076076', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2644', 'es', '3', 'registration_help', 'It is recommended that you register your site in order to receive security alerts and access to Moodle.net, our course sharing platform.', 'Registrar su sitio en Moodle.org se recomienda para recibir alertas de seguridad, para contribuir a las <a href=\"http://moodle.org/stats\">estadísticas de uso de Moodle</a> y para poder compartir cursos en <a href=\"http://moodle.org/\">Moodle.net</a>.', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2645', 'es', '3', 'registrationwarning', 'Your site is not yet registered.', 'Su sitio aún no está registrado.', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2646', 'es', '3', 'releasenoteslink', 'For information about this version of Moodle, please see the online <a target=\"_blank\" href=\"{$a}\">Release Notes</a>', 'Si desea información sobre esta versión de Moodle, por favor vea <a target=\"_blank\" href=\"{$a}\">Release Notes</a>', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2647', 'es', '3', 'rememberusername', 'Remember username', 'Recordar nombre de usuario', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2648', 'es', '3', 'rememberusername_desc', 'Enable if you want to store permanent cookies with usernames during user login. Permanent cookies may be considered a privacy issue if used without consent.', 'Activar si desea almacenar las cookies permanentes con nombres de usuario durante el inicio de sesión. Las cookies permanentes se deben tratar como un asunto de privacidad si se utilizan sin consentimiento.', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2649', 'es', '3', 'reportsmanage', 'Manage reports', 'Gestionar informes', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2650', 'es', '3', 'requiredentrieschanged', '<strong>IMPORTANT - PLEASE READ<br/>(This warning message will only be displayed during this upgrade)</strong><br/>Due to a bug fix, the behaviour of database activities using the \'Required entries\' and \'Required entries before viewing settings\' settings will change. A more detailed explanation of the changes can be read on <a href=\"http://moodle.org/mod/forum/discuss.php?d=110928\" target=\"_blank\">the database module forum</a>. The expected behavior of these settings can also be read on <a href=\"http://docs.moodle.org/en/Adding/editing_a_database#Required_entries\" target=\"_blank\">Moodle Docs</a>.\n<br/><br/>This change affects the following databases in your system: (Please save this list now, and after the upgrade, check that these activities still work the way that the teacher intends.)<br/><strong>{$a->text}</strong><br/>', '<strong>IMPORTANTE - LÉALO, POR FAVOR<br/>(Este mensaje de advertencia sólo aparecerá durante esta actualización)</strong><br/>Debido a la solución de un \'bug\', cambiará el comportamiento de las actividades base de datos que utilizan los ajustes \'Entradas requeridas\' y \'Entradas requeridas antes de ver los ajustes\'. Puede ver una explicación más detallada de estos cambios en <a href=\"http://moodle.org/mod/forum/discuss.php?d=110928\" target=\"_blank\">el foro del módulo base de datos</a>. El funcionamiento esperado de estos ajustes puede consultarse asimismo en <a href=\"http://docs.moodle.org/en/Adding/editing_a_database#Required_entries\" target=\"_blank\">Moodle Docs</a>.\n<br/><br/>Este cambio afecta a las siguientes bases de datos de su sistema: (Por favor, guarde ahora esta lista y, después de la actualización, compruebe que estas actividades siguen funcionando del modo que desea el profesor.)<br/><strong>{$a->text}</strong><br/>', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2651', 'es', '3', 'requiremodintro', 'Require activity description', 'Requerir descripción de la actividad', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2652', 'es', '3', 'requiremodintro_desc', 'If enabled, users will be forced to enter a description for each activity.', 'Si se activa, los usuarios serán forzados a ingresar una descripción para cada actividad.', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2653', 'es', '3', 'requires', 'Requires', 'Requerido', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2654', 'es', '3', 'purgecaches', 'Purge all caches', 'Purgar todas las cachés', null, '1472076077', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2655', 'es', '3', 'purgecachesconfirm', 'Moodle can cache themes, javascript, language strings, filtered text, rss feeds and many other pieces of calculated data.  Purging these caches will delete that data from the server and force browsers to refetch data, so that you can be sure you are seeing the most up-to-date values produced by the current code.  There is no danger in purging caches, but your site may appear slower for a while until the server and clients calculate new information and cache it.', 'Moodle puede guardar en caché los temas, javascript, cadenas de idioma, texto filtrado, RSS feeds y muchos otros datos. La depuración de estos datos en el servidor forzará a los navegadores de los clientes a actualizar la información y usted se asegurará de que los usuarios están viendo la información con los cambios más recientes. No se corre ningún riesgo por hacerlo, aunque su sitio podría parecer algo más lento en un principio hasta que el servidor y los clientes vuelven a actualizar la información guardándose nuevamente los datos en la caché.', null, '1472076078', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2656', 'es', '3', 'purgecachesfinished', 'All caches were purged.', 'Todas las cachés han sido purgadas', null, '1472076078', null, '0', '0');
