INSERT INTO `mdl_tool_customlang` VALUES ('2660', 'es', '3', 'restorernewroleid_help', 'If the user does not already have the permission to manage the newly restored course, the user is automatically assigned this role and enrolled if necessary. Select \"None\" if you do not want restorers to be able to manage every restored course.', 'Si el usuario no tiene todavía permiso para administrar el curso recién restaurado, se le asignar este permiso automáticamente y se le da de alta  en caso necesario. Seleccione \"Ninguno\" si no quieres que los restauradores puedan gestionar todos los cursos restaurados.', null, '1472076078', null, '0', '0');
