INSERT INTO `mdl_tool_customlang` VALUES ('2705', 'es', '3', 'showuseridentity_desc', 'When selecting or searching for users, and when displaying lists of users, these fields may be shown in addition to their full name. The fields are only shown to users who have the moodle/site:viewuseridentity capability; by default, teachers and managers. (This option makes most sense if you choose one or two fields that are mandatory at your institution.)', 'Al seleccionar o buscar usuarios, y cuando se muestran las listas de usuarios, estos campos se mostraran adicionalmente a su nombre completo. Los campos sólo se muestran a los usuarios que tienen la capacidad moodle/site:viewuseridentity por defecto, profesores y managers. (Esta opción tiene más sentido si selecciona uno o dos campos obligatorios en su institución.)', null, '1472076081', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2706', 'es', '3', 'simplexmlrequired', 'The SimpleXML PHP extension is now required by Moodle.', 'Moodle requiere ahora la extensión SimpleXML de PHP.', null, '1472076081', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2707', 'es', '3', 'sitemaintenance', 'The site is undergoing maintenance and is currently not available', 'Este sitio está en fase de mantenimiento y no está disponible en este momento', null, '1472076081', null, '0', '0');
