INSERT INTO `mdl_tool_customlang` VALUES ('2709', 'es', '3', 'sitemaintenanceoff', 'Maintenance mode has been disabled and the site is running normally again', 'El modo de mantenimiento está desactivado y el sitio vuelve a funcionar con normalidad', null, '1472076081', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2710', 'es', '3', 'sitemaintenanceon', 'Your site is currently in maintenance mode (only admins can log in or use the site).', 'El sitio está en modo mantenimiento (sólo los administradores tienen acceso).', null, '1472076081', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2711', 'es', '3', 'sitemaintenanceoncli', 'Your site is currently in CLI maintenance mode, no web access is allowed.', 'Su sitio está actualmente en modo de mantenimiento CLI, no se permiten accesos web .', null, '1472076081', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2712', 'es', '3', 'sitemaintenancewarning', 'Your site is currently in maintenance mode (only admins can log in).  To return this site to normal operation, <a href=\"maintenance.php\">disable maintenance mode</a>.', 'El sitio está en modo mantenimiento (sólo los administradores tienen acceso). Para ponerlo en funcionamiento de nuevo, <a href=\"maintenance.php\">desactive el modo de mantenimiento</a>.', null, '1472076082', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2713', 'es', '3', 'sitemaintenancewarning2', 'Your site is currently in maintenance mode (only admins can log in).  To return this site to normal operation, <a href=\"{$a}\">disable maintenance mode</a>.', 'Su sitio se encuentra actualmente en modo de mantenimiento (solo los administradores pueden iniciar sesión). Para devolver este sitio a la operación normal, <a href=\"{$a}\">desactive el modo de mantenimiento</a>.', null, '1472076082', null, '0', '0');
