INSERT INTO `mdl_tool_customlang` VALUES ('2716', 'es', '3', 'sitepolicy_help', 'If you have a site policy that all registered users must see and agree to before using this site, then specify the URL to it here, otherwise leave this field blank. This setting can contain any public URL.', 'Si su política exige que todos los usuarios lean y acepten sus condiciones antes de usar el sitio, especifique aquí la URL que muestre esta información; en caso contrario, deje el campo en blanco. Este campo de configuración puede contener  cualquier dirección URL pública.', null, '1472076082', null, '0', '0');
