INSERT INTO `mdl_tool_customlang` VALUES ('2821', 'es', '3', 'unsupporteddbtablerowformat', 'Your database has tables using Antelope as the file format. You are recommended to convert the tables to the Barracuda file format. See the documentation <a href=\"https://docs.moodle.org/en/cli\">Administration via command line</a> for details of a tool for converting InnoDB tables to Barracuda.', 'Su base de datos tiene tablas utilizando el formato de fichero Antelope. Se le recomienda convertir las tablas al formato de fichero Barracuda. Revise la documentación <a href=\"https://docs.moodle.org/29/en/Administration_via_command_line\">Administración mediante línea de comandos</a> para detalles de la herramienta para convertir tablas InnoDB a Barracuda.', null, '1472076091', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2822', 'es', '3', 'unsupportedphpversion7', 'PHP version 7 is not supported.', 'La versión 7 de PHP no está soportada.', null, '1472076091', null, '0', '0');
