INSERT INTO `mdl_tool_customlang` VALUES ('2884', 'es', '3', 'warningiconvbuggy', 'Your version of the iconv library does not support the //IGNORE modifier. You should install the mbstring extension which can be used instead for cleaning strings containing invalid UTF-8 characters.', 'Su versión de la biblioteca de iconv no soporta el modificador  //IGNORE. Usted debe instalar la extensión mbstring que puede emplearse en su lugar para limpiar cadenas que contengan caracteres UTF-8 inválidos.', null, '1472076095', null, '0', '0');
