INSERT INTO `mdl_tool_customlang` VALUES ('2889', 'es', '3', 'ziprequired', 'The Zip PHP extension is now required by Moodle, info-ZIP binaries or PclZip library are not used anymore.', 'Moodle requiere ahora la extensión Zip PHP. Ya no se usan ni las binarias info-ZIP ni la librería PclZip.', null, '1472076096', null, '0', '0');
