INSERT INTO `mdl_tool_customlang` VALUES ('2893', 'es', '3', 'cacherequesthelp', 'User specific cache that expires when the request is complete. Designed to replace areas where we are using the static stores.', 'Caché específica de usuario que caduca cuando se completa la solicitud. Diseñada para remplazar áreas en donde estamos usando los almacenamientos estáticos.', null, '1472076096', null, '0', '0');
