INSERT INTO `mdl_tool_customlang` VALUES ('2895', 'es', '3', 'cachesessionhelp', 'User specific cache that expires when the user\'s session ends. Designed to alleviate session bloat/strain.', 'Caché específica del usuario que caduca cuando termina la sesión del usuario. Diseñada para aliviar la sobrecarga de la sesión.', null, '1472076096', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2896', 'es', '3', 'cacheapplication', 'Application cache', 'Caché de aplicación', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2897', 'es', '3', 'cacheapplicationhelp', 'Cached items are shared among all users and expire by a determined time to live (ttl).', 'Los items en caché se comparten entre los usuarios y caducan en un tiempo determinado.', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2898', 'es', '4', 'actantivirushdr', 'Available antivirus plugins', 'Plugins de antivirus disponibles', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2899', 'es', '4', 'antiviruses', 'Antivirus plugins', 'Plugins de antivirus', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2900', 'es', '4', 'antivirussettings', 'Manage antivirus plugins', 'Administrar plugins de antivirus', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2901', 'es', '4', 'configantivirusplugins', 'Please choose the antivirus plugins you wish to use and arrange them in order of being applied.', 'Por favor, elige los plugins de antivirus que deseas utilizar y organízalos en el orden en que serán aplicados.', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2902', 'es', '4', 'emailsubject', '{$a} :: Antivirus notification', '{$a} :: Notificación Clam AV', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2903', 'es', '4', 'virusfounduser', 'The file you have uploaded, {$a->filename}, has been scanned by a virus checker and found to be infected! Your file upload was NOT successful.', 'El archivo subido, {$a->filename}, ha sido escaneado por un antivirus y está infectado. NO se ha podido subir.', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2904', 'es', '5', 'actauthhdr', 'Available authentication plugins', 'Plugins de identificación disponibles', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2905', 'es', '5', 'alternatelogin', 'If you enter a URL here, it will be used as the login page for this site. The page should contain a form which has the action property set to <strong>\'{$a}\'</strong> and return fields <strong>username</strong> and <strong>password</strong>.<br />Be careful not to enter an incorrect URL as you may lock yourself out of this site.<br />Leave this setting blank to use the default login page.', 'Si introduce aquí una URL, se usará como página de acceso al sitio. La página debería contener un formulario cuya propiedad de acción está ajustada a <strong>\'{$a}\'</strong> y devuelve los campos <strong>nombre de usuario</strong> y <strong>contraseña</strong>.<br />Procure no introducir una URL incorrecta puesto que hacerlo supondrá su expulsión del sitio.<br />Deje el ajuste en blanco para utilizar la página de acceso por defecto.', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2906', 'es', '5', 'alternateloginurl', 'Alternate login URL', 'URL de acceso alternativo', null, '1472076097', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2907', 'es', '5', 'auth_common_settings', 'Common settings', 'Ajustes comunes', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2908', 'es', '5', 'auth_data_mapping', 'Data mapping', 'Mapeado de datos', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2909', 'es', '5', 'authenticationoptions', 'Authentication options', 'Opciones de identificación', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2910', 'es', '5', 'auth_fieldlock', 'Lock value', 'Bloquear valor', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2911', 'es', '5', 'auth_fieldlock_expl', '<p><b>Lock value:</b> If enabled, will prevent Moodle users and admins from editing the field directly. Use this option if you are maintaining this data in the external auth system. </p>', '<p><b>Bloquear valor:</b> Si se activa, los usuarios y administradores de Moodle no podrán editar directamente el campo. Utilice esta opción si mantiene estos datos en el sistema de identificación externo. </p>', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2912', 'es', '5', 'auth_fieldlocks', 'Lock user fields', 'Bloquear campos de usuario', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2913', 'es', '5', 'auth_fieldlocks_help', '<p>You can lock user data fields. This is useful for sites where the user data is maintained by the administrators manually by editing user records or uploading using the \'Upload users\' facility. If you are locking fields that are required by Moodle, make sure that you provide that data when creating user accounts or the accounts will be unusable.</p><p>Consider setting the lock mode to \'Unlocked if empty\' to avoid this problem.</p>', '<p>Usted puede bloquear los campos de datos de los usuarios, lo que resulta útil en sitios donde esos datos están mantenidos por administradores de forma manual, editando los registros de los usuarios o subiéndolos mediante la utilidad \'Subir usuarios\'. Si usted bloquea campos requeridos por Moodle, asegúrese de que proporciona esos datos al crear las cuentas de los usuarios; de otro modo las cuentas no serán utilizables.</p><p>Considere fijar esta opción de bloqueo en \'Desbloqueado si está vacío\', para evitar este problema.</p>', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2914', 'es', '5', 'auth_changepasswordhelp', 'Change password help', 'Ayuda sobre cambio de contraseña', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2915', 'es', '5', 'auth_changepasswordhelp_expl', 'Display lost password help to users who have lost their {$a} password. This will be displayed either as well as or instead of the <strong>Change Password URL</strong> or Internal Moodle password change.', 'Muestra ayuda a los usuarios que han perdido su contraseña {$a}. Esta opción puede mostrarse como añadidura o en lugar de la <strong>URL de cambio de contraseña</strong> o como un cambio de contraseña interno de Moodle.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2916', 'es', '5', 'auth_changepasswordurl', 'Change password URL', 'URL Cambio de contraseña', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2917', 'es', '5', 'auth_changepasswordurl_expl', 'Specify the url to send users who have lost their {$a} password. Set <strong>Use standard Change Password page</strong> to <strong>No</strong>.', 'Especifique la URL a la que enviar a los usuarios que han perdido su contraseña {$a}. Seleccione <strong>No</strong> en la <strong>Página Usar página estándar de cambio de contraseña</strong>.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2918', 'es', '5', 'auth_changingemailaddress', 'You have requested a change of email address, from {$a->oldemail} to {$a->newemail}. For security reasons, we are sending you an email message at the new address to confirm that it belongs to you. Your email address will be updated as soon as you open the URL sent to you in that message.', 'Usted ha solicitado un cambio de dirección email, desde {$a->oldemail} a {$a->newemail}. Por razones de seguridad, le hemos enviado un mensaje de email a la nueva dirección para confirmar que usted es el titular. Su nueva dirección será actualizada una vez que abra la dirección que le enviamos en ese mensaje.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2919', 'es', '5', 'authinstructions', 'Leave this blank for the default login instructions to be displayed on the login page. If you want to provide custom login instructions, enter them here.', 'Deje esta opción en blanco para mostrar las instrucciones por defecto de entrada al sitio en la página de entrada. Si desea proporcionar instrucciones personalizadas introdúzcalas aquí.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2920', 'es', '5', 'auth_invalidnewemailkey', 'Error: if you are trying to confirm a change of email address, you may have made a mistake in copying the URL we sent you by email. Please copy the address and try again.', 'Error: Si está intentando confirmar un cambio de dirección email. debe haber cometido un error al copiar la URL que le enviamos por email. Por favor, copie la dirección y pruebe de nuevo.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2921', 'es', '5', 'auth_multiplehosts', 'Multiple hosts OR addresses can be specified (eg host1.com;host2.com;host3.com) or (eg xxx.xxx.xxx.xxx;xxx.xxx.xxx.xxx)', 'Es posible especificar múltiples servidores (por ej. servidor1.com;servidor2.com;servidor3.com', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2922', 'es', '5', 'auth_notconfigured', 'The authentication method {$a} is not configured.', 'El método de autenticación {$a} no está configurado.', null, '1472076098', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2923', 'es', '5', 'auth_outofnewemailupdateattempts', 'You have run out of allowed attempts to update your email address. Your update request has been cancelled.', 'Ha hecho más intentos de los permitidos para actualizar su dirección de email. Su solicitud de actualización ha sido cancelada.', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2924', 'es', '5', 'auth_passwordisexpired', 'Your password is expired. Do you want change your password now?', 'Su contraseña ha caducado ¿Desea cambiar su contraseña ahora?', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2925', 'es', '5', 'auth_passwordwillexpire', 'Your password will expire in {$a} days. Do you want change your password now?', 'Su contraseña caducará en {$a} días ¿Desea cambiar su contraseña ahora?', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2926', 'es', '5', 'auth_remove_delete', 'Full delete internal', 'Borrado completo', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2927', 'es', '5', 'auth_remove_keep', 'Keep internal', 'Mantener interna', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2928', 'es', '5', 'auth_remove_suspend', 'Suspend internal', 'Suspender interna', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2929', 'es', '5', 'auth_remove_user', 'Specify what to do with internal user account during mass synchronization when user was removed from external source. Only suspended users are automatically revived if they reappear in ext source.', 'Especifique qué hacer con una cuenta de usuario interna durante sincronización masiva cuando el usuario fue eliminado de la fuente externa. Únicamente los usuarios suspendidos son automáticamente revividos si ellos reaparecen en una fuente externa.', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2930', 'es', '5', 'auth_remove_user_key', 'Removed ext user', 'Usuario externo eliminado', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2931', 'es', '5', 'auth_sync_suspended', 'When enabled, the suspended attribute will be used to update the local user account\'s suspension status.', 'When enabled, the suspended attribute will be used to update the local user account\'s suspension status.', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2932', 'es', '5', 'auth_sync_suspended_key', 'Synchronize local user suspension status', 'Synchronize local user suspension status', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2933', 'es', '5', 'auth_sync_script', 'User account syncronisation', 'Script de sincronización del Cron', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2934', 'es', '5', 'auth_updatelocal', 'Update local', 'Actualizar datos locales', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2935', 'es', '5', 'auth_updatelocal_expl', '<p><b>Update local:</b> If enabled, the field will be updated (from external auth) every time the user logs in or there is a user synchronization. Fields set to update locally should be locked.</p>', '<p><b>Actualizar datos locales:</b> Si está activado, el campo debe ser actualizado (con identificación externa) cada vez que el usuario entra o se produce una sincronización de usuarios. Los campos a actualizar localmente deberían ser bloqueados.</p>', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2936', 'es', '5', 'auth_updateremote', 'Update external', 'Actualizar datos externos', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2937', 'es', '5', 'auth_updateremote_expl', '<p><b>Update external:</b> If enabled, the external auth will be updated when the user record is updated. Fields should be unlocked to allow edits.</p>', '<p><b>Actualizar datos externos:</b> Si está activado, la identificación externa será actualizada cuando se actualice el registro del usuario. Los campos deberían estar desbloqueados para poder editarlos.</p>', null, '1472076099', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2938', 'es', '5', 'auth_updateremote_ldap', '<p><b>Note:</b> Updating external LDAP data requires that you set binddn and bindpw to a bind-user with editing privileges to all the user records. It currently does not preserve multi-valued attributes, and will remove extra values on update. </p>', '<p><b>Note:</b> La actualización de datos LDAP externos requiere que usted ajuste los valores \'binddn\' y \'bindpw\' a un usuario con privilegios de edición de todos los registros de usuario. Por el momento, esto no preserva los atributos multi-valor, y eliminará los valores extra durante la actualización. </p>', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2939', 'es', '5', 'auth_user_create', 'Enable user creation', 'Habilitar creación por parte del usuario', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2940', 'es', '5', 'auth_user_creation', 'New (anonymous) users can create user accounts on the external authentication source and confirmed via email. If you enable this , remember to also configure module-specific options for user creation.', 'Los nuevos usuarios (anónimos) pueden crear cuentas de usuario sobre el código externo de identificación y confirmar vía correo electrónico. Si usted habilita esto, recuerde también configurar las opciones del módulo específico para la creación de usuario.', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2941', 'es', '5', 'auth_usernameexists', 'Selected username already exists. Please choose a new one.', 'El nombre de usuario seleccionado ya existe. Por favor, elija otro.', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2942', 'es', '5', 'auto_add_remote_users', 'Auto add remote users', 'Añadir automáticamente usuarios remotos', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2943', 'es', '5', 'createpassword', 'Generate password and notify user', 'Generar contraseña y notificar al usuario', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2944', 'es', '5', 'createpasswordifneeded', 'Create password if needed and send via email', 'Crear contraseña si es necesario', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2945', 'es', '5', 'emailchangecancel', 'Cancel email change', 'Cancelar cambio de email', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2946', 'es', '5', 'emailchangepending', 'Change pending. Open the link sent to you at {$a->preference_newemail}.', 'Cambio pendiente. Abra el enlace enviado en {$a->preference_newemail}.', null, '1472076100', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2947', 'es', '5', 'emailnowexists', 'The email address you tried to assign to your profile has been assigned to someone else since your original request. Your request for change of email address is hereby cancelled, but you may try again with a different address.', 'La dirección email que ha intentado asignar a su perfil ha sido asignada a otra persona. Su solicitud de cambio queda cancelada, pero puede intentarlo con otra dirección.', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2948', 'es', '5', 'emailupdate', 'Email address update', 'Actualizar dirección Email', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2949', 'es', '5', 'emailupdatemessage', 'Dear {$a->fullname},\n\nYou have requested a change of your email address for your user account at {$a->site}. Please open the following URL in your browser in order to confirm this change.\n\n{$a->url}', 'Estimado(a) {$a->fullname},\n\nHa solicitado un cambio de su dirección email en su cuenta de {$a->site}. Abra por favor la siguiente dirección en su navegador para confirmar este cambio.\n\n{$a->url}', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2950', 'es', '5', 'emailupdatesuccess', 'Email address of user <em>{$a->fullname}</em> was successfully updated to <em>{$a->email}</em>.', 'La dirección email del usuario <em>{$a->fullname}</em> ha sido actualizada con éxito a <em>{$a->email}</em>.', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2951', 'es', '5', 'emailupdatetitle', 'Confirmation of email update at {$a->site}', 'Confirmación de actualización de email en {$a->site}', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2952', 'es', '5', 'enterthenumbersyouhear', 'Enter the numbers you hear', 'Escriba los números que oye', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2953', 'es', '5', 'enterthewordsabove', 'Enter the words above', 'Escriba las palabras de arriba', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2954', 'es', '5', 'errormaxconsecutiveidentchars', 'Passwords must have at most {$a} consecutive identical characters.', 'Las contraseñas deben tener como máximo {$a} caracteres consecutivos idénticos', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2955', 'es', '5', 'errorminpassworddigits', 'Passwords must have at least {$a} digit(s).', 'Las contraseñas deben tener al menos {$a} dígito(s).', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2956', 'es', '5', 'errorminpasswordlength', 'Passwords must be at least {$a} characters long.', 'Las contraseñas deben tener al menos una longitud de {$a} caracteres.', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2957', 'es', '5', 'errorminpasswordlower', 'Passwords must have at least {$a} lower case letter(s).', 'Las contraseñas deben tener al menos {$a} minúscula(s).', null, '1472076101', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2958', 'es', '5', 'errorminpasswordnonalphanum', 'Passwords must have at least {$a} non-alphanumeric character(s) such as as *, -, or #.', 'Las contraseñas deben tener al menos {$a} caracter(es) no alfanumérico(s).', null, '1472076102', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2959', 'es', '5', 'errorpasswordreused', 'This password has been used before, and is not permitted to be reused', 'Esta contraseña ha sido utilizada anteriormente, y no está permitido reutilizarla', null, '1472076102', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2960', 'es', '5', 'errorminpasswordupper', 'Passwords must have at least {$a} upper case letter(s).', 'Las contraseñas deben tener al menos {$a} mayúscula(s).', null, '1472076102', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2961', 'es', '5', 'errorpasswordupdate', 'Error updating password, password not changed', 'Error actualizando contraseña, la contraseña no ha cambiado', null, '1472076102', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2962', 'es', '5', 'eventuserloggedin', 'User has logged in', 'El usuario ha iniciado sesión', null, '1472076102', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2963', 'es', '5', 'eventuserloggedinas', 'User logged in as another user', 'El usuario inicia sesión como otro usuario', null, '1472076102', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2964', 'es', '5', 'eventuserloginfailed', 'User login failed', 'Inicio de sesión fallido', null, '1472076102', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2965', 'es', '5', 'forcechangepassword', 'Force change password', 'Forzar cambio de contraseña', null, '1472076102', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2966', 'es', '5', 'forcechangepasswordfirst_help', 'Force users to change password on their first login to Moodle.', 'Forzar a los usuarios a cambiar la contraseña la primera vez que accedan a Moodle.', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2967', 'es', '5', 'forcechangepassword_help', 'Force users to change password on their next login to Moodle.', 'Forzar a los usuarios a cambiar la contraseña la próxima vez que accedan a Moodle.', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2968', 'es', '5', 'forgottenpassword', 'If you enter a URL here, it will be used as the lost password recovery page for this site. This is intended for sites where passwords are handled entirely outside of Moodle. Leave this blank to use the default password recovery.', 'Si escribe aquí una URL, se usará como página de recuperación de la contraseña perdida para este sitio. Esto está pensado para sitios en los que las contraseñas se gestionan totalmente fuera de Moodle. Déjelo en blanco para usar la recuperación por defecto de la contraseña.', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2969', 'es', '5', 'forgottenpasswordurl', 'Forgotten password URL', 'URL contraseña olvidada', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2970', 'es', '5', 'getanaudiocaptcha', 'Get an audio CAPTCHA', 'Obtener un CAPTCHA de audio', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2971', 'es', '5', 'getanimagecaptcha', 'Get an image CAPTCHA', 'Obtener un CAPTCHA de imagen', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2972', 'es', '5', 'getanothercaptcha', 'Get another CAPTCHA', 'Obtener otro CAPTCHA', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2973', 'es', '5', 'guestloginbutton', 'Guest login button', 'Botón de entrada para invitados', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2974', 'es', '5', 'changepassword', 'Change password URL', 'Cambiar contraseña URL', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2975', 'es', '5', 'changepasswordhelp', 'URL of lost password recovery page, which will be sent to users in an email. Note that this setting will have no effect if a forgotten password URL is set in the authentication common settings.', 'Aquí puede especificar dónde pueden sus usuarios recuperar o cambiar su nombre de usuario/contraseña si lo han olvidado. Para ello, aparecerá un botón en la página de entrada. Si deja esto en blanco, este botón no se mostrará.', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2976', 'es', '5', 'chooseauthmethod', 'Choose an authentication method', 'Escoger un método de identificación:', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2977', 'es', '5', 'chooseauthmethod_help', 'This setting determines the authentication method used when the user logs in. Only enabled authentication plugins should be chosen, otherwise the user will no longer be able to log in. To block the user from logging in, select \"No login\".', 'Este elemento determina el método de autentificación utilizado cuando el usuario entra en el sitio. Sólo deben elegirse los plugins de actualización que hayan sido habilitados, si no fuera así el usuario no podría conectarse. Para bloquear la entrada del usuario, seleccione \'Sin login\'.', null, '1472076103', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2978', 'es', '5', 'incorrectpleasetryagain', 'Incorrect. Please try again.', 'Incorrecto. Por favor, inténtelo de nuevo.', null, '1472076104', null, '0', '0');
