INSERT INTO `mdl_tool_customlang` VALUES ('2989', 'es', '5', 'limitconcurrentlogins', 'Limit concurrent logins', 'Bloquear inicios de sesión simultáneos', null, '1472076104', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2990', 'es', '5', 'limitconcurrentlogins_desc', 'If enabled the number of concurrent browser logins for each user is restricted. The oldest session is terminated after reaching the limit, please note that users may lose all unsaved work. This setting is not compatible with single sign-on (SSO) authentication plugins.', 'Si se activa se limitará el número de inicios de sesión vía navegador para cada usuario. La sesión más vieja será cerrada después de alcanzar el límite, por favor indique a los usuarios que pueden perder todo el trabajo no guardado. Esta configuración no es compatible con plugins de autentificación de un sólo uso.', null, '1472076104', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2991', 'es', '5', 'locked', 'Locked', 'Bloqueado', null, '1472076104', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2992', 'es', '5', 'authloginviaemail', 'Allow log in via email', 'Permitir acceso por email', null, '1472076104', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2993', 'es', '5', 'authloginviaemail_desc', 'Allow users to use both username and email address (if unique) for site login.', 'Permitir a los usuarios acceder al sitio indistintamente con su nombre de usuario o con su  dirección de correo (siempre que sea única).', null, '1472076104', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2994', 'es', '5', 'allowaccountssameemail', 'Allow accounts with same email', 'Permitir cuentas con la misma dirección de correo', null, '1472076105', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2995', 'es', '5', 'allowaccountssameemail_desc', 'If enabled, more than one user account can share the same email address. This may result in security or privacy issues, for example with the password change confirmation email.', 'Si se activa, más de una cuenta de usuario podrá compartir la misma dirección de correo. Esto puede resultar en problemas de seguridad o privacidad, por ejemplo con el email de confirmación de cambio de clave.', null, '1472076105', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('2996', 'es', '5', 'md5', 'MD5 hash', 'Encriptación MD5', null, '1472076105', null, '0', '0');
