INSERT INTO `mdl_tool_customlang` VALUES ('2998', 'es', '5', 'nopasswordchangeforced', 'You cannot proceed without changing your password, however there is no available page for changing it. Please contact your Moodle Administrator.', 'No puede seguir sin cambiar su contraseña, sin embargo no existe ninguna página disponible para cambiarla. Por favor contacte a su administrador de Moodle.', null, '1472076105', null, '0', '0');
