INSERT INTO `mdl_tool_customlang` VALUES ('3009', 'es', '5', 'recaptcha_help', 'The CAPTCHA is for preventing abuse from automated programs. Simply enter the words in the box, in order and separated by a space.\n\nIf you are not sure what the words are, you can try getting another CAPTCHA or an audio CAPTCHA.', 'El CAPTCHA se utiliza para impedir abusos de programas automáticos. Simplemente escriba las palabras en la caja, en orden y separadas por un espacio.\n\nSi no está seguro de qué palabras son, puede conseguir otro CAPTCHA, o un CAPTCHA de audio.', null, '1472076106', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3010', 'es', '5', 'recaptcha_link', 'auth/email', 'auth/email', null, '1472076106', null, '0', '0');
