INSERT INTO `mdl_tool_customlang` VALUES ('3012', 'es', '5', 'selfregistration', 'Self registration', 'Registrarse a sí mismo', null, '1472076106', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3013', 'es', '5', 'selfregistration_help', 'If an authentication plugin, such as email-based self-registration, is selected, then it enables potential users to register themselves and create accounts. This results in the possibility of spammers creating accounts in order to use forum posts, blog entries etc. for spam. To avoid this risk, self-registration should be disabled or limited by <em>Allowed email domains</em> setting.', 'Escoja qué conector (\'plugin\') de identificación manejar cuando los usuarios se registren a sí mismos.', null, '1472076106', null, '0', '0');
