INSERT INTO `mdl_tool_customlang` VALUES ('3015', 'es', '5', 'showguestlogin', 'You can hide or show the guest login button on the login page.', 'Puede ocultar o mostrar el botón de entrada para invitados en la página de acceso.', null, '1472076106', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3016', 'es', '5', 'stdchangepassword', 'Use standard page for changing password', 'Utilizar Página de cambio de contraseña estándar', null, '1472076106', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3017', 'es', '5', 'stdchangepassword_expl', 'If the external authentication system allows password changes through Moodle, switch this to Yes. This setting overrides \'Change Password URL\'.', 'Si el sistema de identificación externa permite cambios de contraseña en Moodle, seleccione Sí. Este ajuste anula la configuración de \'Cambiar contraseña URL\'.', null, '1472076106', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3018', 'es', '5', 'stdchangepassword_explldap', 'NOTE: It is recommended that you use LDAP over an SSL encrypted tunnel (ldaps://) if the LDAP server is remote.', 'NOTA: Se recomienda que utilice LDAP sobre un túnel encriptado SSL (ldaps://) si el servidor LDAP es remoto.', null, '1472076106', null, '0', '0');
