INSERT INTO `mdl_tool_customlang` VALUES ('3020', 'es', '5', 'suspended_help', 'Suspended user accounts cannot log in or use web services, and any outgoing messages are discarded.', 'Las cuentas de usuarios suspendidas no pueden acceder o utilizar los servicios web y los mensajes salientes se descartan.', null, '1472076107', null, '0', '0');
