INSERT INTO `mdl_tool_customlang` VALUES ('3079', 'es', '7', 'autoactivedescription', 'Choose whether or not to do automated backups. If manual is selected automated backups will be possible only by through the automated backups CLI script. This can be done either manually on the command line or through cron.', 'Escoja si desea o no hacer copias de seguridad automáticas. Si selecciona el modo manual las copias de seguridad automáticas sólo serán posibles mediante el \"script\" CLI. También se pueden hacer manualmente mediante la línea de comandos o a través del cron.', null, '1472076111', null, '0', '0');
