INSERT INTO `mdl_tool_customlang` VALUES ('3088', 'es', '7', 'automatedminkepthelp', 'If backups older than a specified number of days are deleted, it can happen that an inactive course ends up with no backup. To prevent this, a minimum number of backups kept should be specified.', 'Si las copias de seguridad anteriores a un número de días especificado se eliminan, puede suceder que un curso inactivo acabe sin copias de seguridad. Para prevenir esto, se debería especificar un número mínimo de copias de seguridad guardadas.', null, '1472076111', null, '0', '0');
