INSERT INTO `mdl_tool_customlang` VALUES ('3132', 'es', '7', 'choosefilefromuserbackup_help', 'Backup files with anonymized user information are stored here.', 'Cuando la copia de seguridad de los cursos tiene marcada la opción \"Hacer anónima la información de usuario\", los archivos de copia de seguridad se guardan aquí', null, '1472076114', null, '0', '0');
