INSERT INTO `mdl_tool_customlang` VALUES ('3138', 'es', '7', 'configgeneralbadges', 'Sets the default for including badges in a backup.', 'Establece el valor por defecto para incluir las insignias en la copia de seguridad.', null, '1472076115', null, '0', '0');
