INSERT INTO `mdl_tool_customlang` VALUES ('3143', 'es', '7', 'configgeneralhistories', 'Sets the default for including user history within a backup.', 'Ajusta los valores por defecto para incluir el historial del usuario dentro de una copia de seguridad.', null, '1472076115', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3144', 'es', '7', 'configgenerallogs', 'If enabled logs will be included in backups by default.', 'Si se activa, se incluirán por defecto registros en las copias de seguridad.', null, '1472076115', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3145', 'es', '7', 'configgeneralquestionbank', 'If enabled the question bank will be included in backups by default. PLEASE NOTE: Disabling this setting will disable the backup of activities which use the question bank, such as the quiz.', 'Si se habilita, el banco de preguntas se incluirá en las copias de seguridad de forma predeterminada. NOTA: la desactivación de esta opción desactivará la copia de seguridad de las actividades que utilizan el banco de preguntas, como es el caso del cuestionario.', null, '1472076115', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3146', 'es', '7', 'configgeneralgroups', 'Sets the default for including groups and groupings in a backup.', 'Establece el valor por defecto en la inclusión de grupos y agrupaciones en una copia de seguridad.', null, '1472076115', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3147', 'es', '7', 'configgeneralroleassignments', 'If enabled by default roles assignments will also be backed up.', 'Si se habilita, los roles asignados por defecto serán también copiados.', null, '1472076115', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3148', 'es', '7', 'configgeneraluserscompletion', 'If enabled user completion information will be included in backups by default.', 'Si se activa, la información del grado de avance de los usuarios se incluirá por defecto en las copias de seguridad.', null, '1472076115', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3149', 'es', '7', 'configgeneralusers', 'Sets the default for whether to include users in backups.', 'Ajusta los valores por defecto para incluir a los usuarios en las copias de seguridad.', null, '1472076116', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3150', 'es', '7', 'configloglifetime', 'This specifies the length of time you want to keep backup logs information. Logs that are older than this age are automatically deleted. It is recommended to keep this value small, because backup logged information can be huge.', 'Especifica el periodo de tiempo durante el que desea mantener la información de los registros de copia de seguridad. Los registros más antiguos que el establecido se borrarán automáticamente. Se recomienda mantener este valor lo más bajo posible, ya que el volumen de la información sobre las  copias de seguridad puede llegar a se muy grande.', null, '1472076116', null, '0', '0');
