INSERT INTO `mdl_tool_customlang` VALUES ('3171', 'es', '7', 'errorminbackup20version', 'This backup file has been created with one development version of Moodle backup ({$a->backup}). Minimum required is {$a->min}. Cannot be restored.', 'Este archivo de copia de seguridad ha sido creado con una versión de desarrollo de copia de seguridad de Moodle ({$a->backup}) y se requiere al menos la versión {$a->min}. Por lo tanto, no puede ser restaurado.', null, '1472076118', null, '0', '0');
