INSERT INTO `mdl_tool_customlang` VALUES ('3178', 'es', '7', 'filealiasesrestorefailuresinfo', 'Some aliases included in the backup file could not be restored. The following list contains their expected location and the source file they were referring to at the original site.', 'Algunos alias incluidos en el archivo de copia de seguridad no pudieron restaurarse. La lista siguiente contiene su localización esperada y el archivo origen al que se estaban refiriendo en el sitio original.', null, '1472076119', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3179', 'es', '7', 'filealiasesrestorefailures_help', 'Aliases are symbolic links to other files, including those stored in external repositories. In some cases, Moodle cannot restore them - for example when restoring the backup at another site or when the referenced file does not exist.\n\nMore details and the actual reason of the failure can be found in the restore log file.', 'Los alias son enlaces simbólicos a otros archivos, incluyendo aquellos almacenados en repositorios externos. En algunos casos, Moodle no puede restaurarlos - por ejemplo cuando se restaura una copia de seguridad en otro sitio o cuando el archivo al que se hace referencia no existe.', null, '1472076119', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3180', 'es', '7', 'filealiasesrestorefailures_link', 'restore/filealiases', 'restore/filealiases', null, '1472076119', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3181', 'es', '7', 'filereferencesincluded', 'File references to external contents are included in the backup file. These won\'t work if the backup is restored on a different site.', 'Las referencias de archivo a contenidos externos incluidos en el paquete de copia de seguridad, no funcionarán en otros sitios.', null, '1472076119', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3182', 'es', '7', 'filereferencessamesite', 'The backup file is from this site, and so file references can be restored.', 'La copia de seguridad es de este sitio, las referencias de archivo se puede restaurar', null, '1472076119', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3183', 'es', '7', 'filereferencesnotsamesite', 'The backup file is from a different site, and so file references cannot be restored.', 'La copia de seguridad es de otro sitio, las referencias de archivo no se puede restaurar', null, '1472076119', null, '0', '0');
