INSERT INTO `mdl_tool_customlang` VALUES ('3350', 'es', '8', 'allowexternalbackpack_desc', 'Allow users to set up connections and display badges from their external backpack providers.\n\nNote: It is recommended to leave this option disabled if the website cannot be accessed from the Internet (e.g. because of the firewall).', 'Permitir a los usuarios configurar conexiones y mostrar insignias de las mochilas de sus proveedores externos.\n\nNota: Se recomienda dejar esta opción desactivada si no se puede acceder al sitio web desde Internet (por ejemplo, debido al firewall).', null, '1472076135', null, '0', '0');
