INSERT INTO `mdl_tool_customlang` VALUES ('3357', 'es', '8', 'archivebadge', 'Would you like to delete badge \'{$a}\', but keep existing issued badges?', '¿Quiere eliminar la insignia \'{$a}\', pero mantener las insignias otorgadas existentes?', null, '1472076135', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3358', 'es', '8', 'archiveconfirm', 'Delete and keep existing issued badges', 'Eliminar y mantener las insignias otorgadas existentes', null, '1472076135', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3359', 'es', '8', 'archivehelp', '<p>This option means that the badge will be marked as \"retired\" and will no longer appear in the list of badges. Users will no longer be able to earn this badge, however existing badge recipients will still be able to display this badge on their profile page and push it to their external backpacks.</p>\n<p>If you would like your users to retain access to the earned badges it is important to select this option instead of fully deleting badges.</p>', '<p>Esta opción significa que la insignia se marcará como \"retirada\" y ya no aparecerá en la lista de insignias. Los usuarios no podrán ganar esta insignia, sin embargo los destinatarios de la insignia existentes seguirán pudiendo mostrarla en su página de perfil y subirla a sus mochilas externas. </p>\n<p> Si desea que sus usuarios pueden mantener el acceso a las insignias obtenidas es importante seleccionar esta opción en lugar de eliminar totalmente las insignias.</p>', null, '1472076135', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3360', 'es', '8', 'attachment', 'Attach badge to message', 'Adjuntar insignia al mensaje', null, '1472076135', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3361', 'es', '8', 'attachment_help', 'If enabled, an issued badge file will be attached to the recipient\'s email for download. (Attachments must be enabled in Site administration > Plugins > Message outputs > Email to use this option.)', 'Si se selecciona, se adjuntará una insignia al correo electrónico que se podrá descargar', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3362', 'es', '8', 'award', 'Award badge', 'Otorgar insignia', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3363', 'es', '8', 'awardedtoyou', 'Issued to me', 'Emitida para mi', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3364', 'es', '8', 'awardoncron', 'Access to the badges was successfully enabled. Too many users can instantly earn this badge. To ensure site performance, this action will take some time to process.', 'El acceso a las insignias se activó con éxito. Muchos usuarios pueden ganar simultáneamente esta insignia. Para garantizar el funcionamiento del sitio, esta acción llevará un cierto tiempo de proceso.', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3365', 'es', '8', 'awards', 'Recipients', 'Destinatarios', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3366', 'es', '8', 'backpackavailability', 'External badge verification', 'Verificación externa de la insignia', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3367', 'es', '8', 'backpackavailability_help', 'For badge recipients to be able to prove they earned their badges from you, an external backpack service should be able to access your site and verify badges issued from it. Your site does not currently appear to be accessible, which means that badges you have already issued or will issue in the future cannot be verified.\n\n**Why am I seeing this message?**\n\nIt may be that your firewall prevents access from users outside your network, your site is password protected, or you are running the site on a computer that is not available from the Internet (such as a local development machine).\n\n**Is this a problem?**\n\nYou should fix this issue on any production site where you are planning to issue badges, otherwise the recipients will not be able to prove they earned their badges from you. If your site is not yet live you can create and issue test badges, as long as the site is accessible before you go live.\n\n**What if I can\'t make my whole site publicly accessible?**\n\nThe only URL required for verification is [your-site-url]/badges/assertion.php so if you are able to modify your firewall to allow external access to that file, badge verification will still work.', 'Para que los receptores de insignias puedan demostrar que han ganado insignias emitidas por usted, un servicio de mochila externo debe poder acceder a su sitio y verificar las insignias emitidas desde aquí.\n\nSu sitio no aparece que sea accesible en este momento, lo que significa que las insignias que ya haya emitido o que se emitan en el futuro no se podrán verificar.\n\n## ¿Por qué me sale este mensaje?\n\nPuede ser que el firewall impida el acceso de usuarios externos a la red, que el sitio esté protegido con contraseña, o que se esté ejecutando el sitio en un equipo que no está disponible en Internet (por ejemplo, una máquina de desarrollo local).\n\n## ¿Es un problema?\n\nDebe solucionar este problema en cada sitio en producción donde vaya a emitir insignias, de lo contrario los destinatarios no serán capaces de probar que han ganado las insignias emitidas por usted\n\nSi su sitio no está activo puede crear y suministrar insignias de prueba, siempre y cuando el sitio sea accesible antes de activarse.\n\n## ¿Qué pasa si no puedo dar acceso público completo a mi sitio?\n\nLa única URL necesaria para la verificación es [su-sitio-url]/badges/assertion.php, por lo que si usted puede modificar el firewall para permitir el acceso externo a ese archivo, la verificación de las  insignias seguirá funcionando.', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3368', 'es', '8', 'backpackbadges', 'You have {$a->totalbadges} badge(s) displayed from {$a->totalcollections} collection(s). <a href=\"mybackpack.php\">Change backpack settings</a>.', 'Usted tiene {$a->totalbadges} insignias que se muestran desde {$a->totalcollections} colecciones. <a href=\"mybackpack.php\">Cambiar la configuración de la mochila</a> .', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3369', 'es', '8', 'backpackconnection', 'Backpack connection', 'Conexión a la mochila', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3370', 'es', '8', 'backpackconnection_help', 'This page allows you to set up connection to an external backpack provider. Connecting to a backpack lets you display external badges within this site and push badges earned here to your backpack.\n\nCurrently, only <a href=\"http://backpack.openbadges.org\">Mozilla OpenBadges Backpack</a> is supported. You need to sign up for a backpack service before trying to set up backpack connection on this page.', 'Esta página le permite configurar la conexión a un proveedor externo de mochilas. Conectarse a una mochila le permite mostrar insignias externas dentro de este sitio y subir las insignias ganadas aquí a su mochila.\n\nActualmente, sólo <a href=\"http://backpack.openbadges.org\">Mochila OpenBadges Mozilla</a> es compatible. Es necesario inscribirse para tener un servicio de mochila antes de tratar de configurar la conexión a la mochila en esta página.', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3371', 'es', '8', 'backpackdetails', 'Backpack settings', 'Configuración de la mochila', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3372', 'es', '8', 'backpackemail', 'Email address', 'Dirección de correo electrónico', null, '1472076136', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3373', 'es', '8', 'backpackemail_help', 'The email address associated with your backpack. While you are connected, any badges earned on this site will be associated with this email address.', 'La dirección de correo electrónico asociada a su mochila. Mientras está conectado, las insignias obtenidas en este sitio se asociarán con esta dirección de correo electrónico.', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3374', 'es', '8', 'personaconnection', 'Sign in with your email', 'Inicie sesión con su dirección de email', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3375', 'es', '8', 'personaconnection_help', 'Persona is a system for identifying yourself across the web, using an email address that you own. The Open Badges backpack uses Persona as a login system, so to be able to connect to a backpack you will need a Persona account.\n\nFor more information about Persona visit <a href=\"https://login.persona.org/about\">https://login.persona.org/about</a>.', 'Persona es un sistema para su identificación en la web, usando una dirección de correo electrónico de su propiedad. La mochila de Open Badges utiliza Persona como sistema de inicio de sesión, por lo que para conectarse a una mochila necesita una cuenta de Persona. Para obtener más información acerca de Persona visite <a href=\"https://login.persona.org/about\">https://login.persona.org/about</a> .', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3376', 'es', '8', 'backpackimport', 'Badge import settings', 'Ajustes de importación de insignias', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3377', 'es', '8', 'backpackimport_help', 'After the backpack connection is successfully established, badges from your backpack can be displayed on your badges page and your profile page.\n\nIn this area, you can select collections of badges from your backpack that you would like to display in your profile.', 'Después de establecerse una conexión correcta a la mochila, las insignias de su mochila pueden verse en la página \"Mis Badges\"  y en su página de perfil.\n\nEn esta área, puede seleccionar las colecciones de insignias de su mochila que quiera mostrar  en su perfil.', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3378', 'es', '8', 'badges', 'Badges', 'Insignias', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3379', 'es', '8', 'badgedetails', 'Badge details', 'Detalles de la insignia', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3380', 'es', '8', 'badgeimage', 'Image', 'Imagen', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3381', 'es', '8', 'badgeimage_help', 'This is an image that will be used when this badge is issued.\n\nTo add a new image, browse and select an image (in JPG or PNG format) then click \"Save changes\". The image will be cropped to a square and resized to match badge image requirements. ', 'Esta es una imagen que se utilizará cuando se emite esta insignia.\n\nPara agregar una nueva imagen, busque y seleccione una imagen (en formato JPG o PNG) y luego haga clic en \"Guardar cambios\". La imagen se recorta y cambia de tamaño para ajustarse a los requisitos de la imagen de la insignia.', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3382', 'es', '8', 'badgeprivacysetting', 'Badge privacy settings', 'Configuración de privacidad de la insignia', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3383', 'es', '8', 'badgeprivacysetting_help', 'Badges you earn can be displayed on your account profile page. This setting allows you to automatically set the visibility of the newly earned badges.\n\nYou can still control individual badge privacy settings on your badges page.', 'Las insignias que usted gane se pueden mostrar en su página de perfil de cuenta. Este ajuste le permite mostrar automáticamente las insignias reciéntemente ganadas.\n\nPuede controlar la configuración de privacidad de las insignias individuales en la página \"Mis insignias\".', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3384', 'es', '8', 'badgeprivacysetting_str', 'Automatically show badges I earn on my profile page', 'Mostrar automáticamente en mi página de perfil las insignias que he ganado', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3385', 'es', '8', 'badgesalt', 'Salt for hashing the recipient\'s email address', 'Salado hash para la dirección de correo electrónica del destinatario', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3386', 'es', '8', 'badgesalt_desc', 'Using a hash allows backpack services to confirm the badge earner without having to expose their email address. This setting should only use numbers and letters.\n\nNote: For recipient verification purposes, please avoid changing this setting once you start issuing badges.', 'Usar un \'hash\' permite que los servicios de mochila confirmen el origen de la insignia sin tener que mostrar su dirección de correo electrónico. Este ajuste debe utilizar solo números y letras.\n\nObservación: Con fines de verificación de los receptores, evite cambiar este ajuste una vez que comience la emisión de insignias', null, '1472076137', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3387', 'es', '8', 'badgesdisabled', 'Badges are not enabled on this site.', 'Las insignias no están habilitados en este sitio.', null, '1472076138', null, '0', '0');
