INSERT INTO `mdl_tool_customlang` VALUES ('3459', 'es', '8', 'criteria_4_help', 'Allows a badge to be awarded to users who have completed the course. This criterion can have additional parameters such as minimum grade and date of course completion.', 'Permite que una insignia se conceda a los usuarios que hayan completado el curso. Este criterio puede tener parámetros adicionales como una calificación mínima y la fecha de finalización del curso.', null, '1472076143', null, '0', '0');
