INSERT INTO `mdl_tool_customlang` VALUES ('3461', 'es', '8', 'criteria_5_help', 'Allows a badge to be awarded to users who have completed a set of courses. Each course can have additional parameters such as minimum grade and date of course completion. ', 'Permite que una insignia se conceda a los usuarios que han completado una serie de cursos. Cada curso puede tener parámetros adicionales como una calificación mínima y la fecha de finalización del curso.', null, '1472076143', null, '0', '0');
