INSERT INTO `mdl_tool_customlang` VALUES ('3463', 'es', '8', 'criteria_6_help', 'Allows a badge to be awarded to users for completing certain fields in their profile. You can select from default and custom profile fields that are available to users. ', 'Permite que una insignia se conceda a los usuarios que han cumplimentado ciertos campos en su perfil personal.  Puede elegir entre los campos de perfil personalizados y los campos de perfil predeterminados.', null, '1472076144', null, '0', '0');
