INSERT INTO `mdl_tool_customlang` VALUES ('3477', 'es', '8', 'delbadge', 'Would you like to delete badge \'{$a}\' and remove all existing issued badges?', '¿Desea borrar la insignia \'{$a}\' y todas las que se han generado a partir de la misma?', null, '1472076145', null, '0', '0');
