INSERT INTO `mdl_tool_customlang` VALUES ('3479', 'es', '8', 'deletehelp', '<p>Fully deleting a badge means that all its information and criteria records will be permanently removed. Users who have earned this badge will no longer be able to access it and display it on their profile pages.</p>\n<p>Note: Users who have earned this badge and have already pushed it to their external backpack, will still have this badge in their external backpack. However, they will not be able to access criteria and evidence pages linking back to this web site.</p>', '<p>Borrar completamente una insignia significa que todos sus registros de información y criterios se eliminarán de forma permanente. Los usuarios que han ganado esta insignia ya no serán capaces de acceder a ella y mostrarla en sus páginas de perfil.</p> <p>Nota: Los usuarios que hayan ganado esta placa y la hayan subido a su mochila externa, aún la tendrán en su mochila. Sin embargo, no podrán acceder a los criterios ni las páginas de evidencia que enlazan con este sitio web.</p>', null, '1472076145', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3480', 'es', '8', 'delcritconfirm', 'Are you sure that you want to delete this criterion?', '¿Estás seguro de que quiere eliminar este criterio?', null, '1472076145', null, '0', '0');
