INSERT INTO `mdl_tool_customlang` VALUES ('3550', 'es', '8', 'localbadgesh_help', 'All badges earned within this web site by completing courses, course activities, and other requirements.\n\nYou can manage your badges here by making them public or private for your profile page.\n\nYou can download all of your badges or each badge separately and save them on your computer. Downloaded badges can be added to your external backpack service.', 'Todas los insignias conseguidas en este sitio web por finalizar cursos, actividades de los cursos y otros requisitos.\n\nAquí puede gestionar sus insignias haciéndolas públicas o privadas en su página de perfil.\n\nPuede descargar todas sus insignias o cada una por separado y guardarlas en su ordenador. Las insignias descargadas pueden añadirse a su servicio de mochila externo.', null, '1472076151', null, '0', '0');
