INSERT INTO `mdl_tool_customlang` VALUES ('3556', 'es', '8', 'messagebody', '<p>You have been awarded the badge \"%badgename%\"!</p>\n<p>More information about this badge can be found on the %badgelink% badge information page.</p>\n<p>You can manage and download the badge from your {$a} page.</p>', '<p> ¡Se le ha otorgado una insignia \"%badgename%\"!</p>\n<p> Puede encontrar más información sobre esta insignia en la %badgelink% página de información de insignias. </p>\n<p> Puede gestionar y descargar la insignia desde {$a}. </p>', null, '1472076151', null, '0', '0');
