INSERT INTO `mdl_tool_customlang` VALUES ('3574', 'es', '8', 'notacceptedrole', 'Your current role assignment is not among the roles that can manually issue this badge.<br/>\nIf you would like to see users who have already earned this badge, you can visit {$a} page. ', 'Su rol asignado actualmente no es uno de los roles que pueden emitir manualmente esta insignia. <br/>\nSi quiere ver los usuarios que ya han ganado esta insignia, puede visitar la página {$a}.', null, '1472076153', null, '0', '0');
