INSERT INTO `mdl_tool_customlang` VALUES ('3578', 'es', '8', 'notification_help', 'This setting manages notifications sent to a badge creator to let them know that the badge has been issued.\n\nThe following options are available:\n\n* **NEVER** – Do not send notifications.\n\n* **EVERY TIME** – Send a notification every time this badge is awarded.\n\n* **DAILY** – Send notifications once a day.\n\n* **WEEKLY** – Send notifications once a week.\n\n* **MONTHLY** – Send notifications once a month.', 'Este ajuste gestiona las notificaciones enviadas a un creador de insignias para hacerles saber que la insignia ha sido emitida.\n\nLas siguientes opciones están disponibles:\n\n* **NUNCA** - No enviar notificaciones.\n\n* **SIEMPRE** - Enviar una notificación cada vez que se concede esta insignia.\n\n* **DIARIAMENTE** - Enviar notificaciones una vez al día.\n\n* **SEMANALMENTE** - Enviar notificaciones una vez a la semana.\n\n*** MENSUALMENTE** - Enviar notificaciones una vez al mes.', null, '1472076154', null, '0', '0');
