INSERT INTO `mdl_tool_customlang` VALUES ('3604', 'es', '8', 'sitebadges', 'Site badges', 'Insignias del sitio', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3605', 'es', '8', 'sitebadges_help', 'Site badges can only be awarded to users for site-related activities. These include completing a set of courses or parts of user profiles. Site badges can also be issued manually by one user to another.\n\nBadges for course-related activities must be created at the course level. Course badges can be found under Course Administration > Badges.', 'Las insignias del sitio sólo pueden ser otorgadas a los usuarios de las actividades relacionadas con el sitio. Estos incluyen completar una serie de cursos o partes de los perfiles de usuario. Las insignias del sitio también pueden ser emitidas manualmente por un usuario para otro.\n\nLa insignias para las actividades relacionadas con los cursos deben ser creados a nivel de curso. Las insignias de curso se pueden encontrar en Administración >  Insignias', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3606', 'es', '8', 'statusmessage_0', 'This badge is currently not available to users. Enable access if you want users to earn this badge. ', 'Esta insignia no está en este momento disponible para los usuarios. Habilite el acceso si desea que los usuarios puedan ganar esta insignia.', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3607', 'es', '8', 'statusmessage_1', 'This badge is currently available to users. Disable access to make any changes. ', 'Esta insignia está en este momento disponible para los usuarios. Deshabilite el acceso para hacer cualquier cambio.', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3608', 'es', '8', 'statusmessage_2', 'This badge is currently not available to users, and its criteria are locked. Enable access if you want users to earn this badge. ', 'Esta insignia no está en este momento disponible para los usuarios, y los criterios están bloqueados. Habilite el acceso si desea que los usuarios puedan ganar esta insignia.', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3609', 'es', '8', 'statusmessage_3', 'This badge is currently available to users, and its criteria are locked. ', 'Esta insignia está en este momento disponible para los usuarios y sus criterios están bloqueados', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3610', 'es', '8', 'statusmessage_4', 'This badge is currently archived.', 'Esta insignia está en este momento archivada.', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3611', 'es', '8', 'status', 'Badge status', 'Estado de la insignia', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3612', 'es', '8', 'status_help', 'Status of a badge determines its behaviour in the system:\n\n* **AVAILABLE** – Means that this badge can be earned by users. While a badge is available to users, its criteria cannot be modified.\n\n* **NOT AVAILABLE** – Means that this badge is not available to users and cannot be earned or manually issued. If such badge has never been issued before, its criteria can be changed.\n\nOnce a badge has been issued to at least one user, it automatically becomes **LOCKED**. Locked badges can still be earned by users, but their criteria can no longer be changed. If you need to modify details or criteria of a locked badge, you can duplicate this badge and make all the required changes.\n\n*Why do we lock badges?*\n\nWe want to make sure that all users complete the same requirements to earn a badge. Currently, it is not possible to revoke badges. If we allowed badges requirements to be modified all the time, we would most likely end up with users having the same badge for meeting completely different requirements.', 'El estado de una insignia determina su comportamiento en el sistema:\n\n* ** DISPONIBLE ** - Significa que esta insignia puede ser ganada por los usuarios. Mientras que una insignia está disponible para los usuarios, los criterios no pueden ser modificados.\n\n* ** NO DISPONIBLE ** - Significa que esta insignia no está disponible para los usuarios y no se puede ganar o emitir manualmente. Si dicha insignia no ha sido emitida antes, los criterios pueden cambiarse.\n\nUna vez que una insignia ha sido emitida por lo menos para un usuario, pasa automáticamente a **BLOQUEADA**.  Los usuarios pueden ontener insignias bloqueadas,  pero sus criterios ya no se pueden cambiar. Si necesita modificar detalles o criterios de una insignia bloqueada, puede duplicar esta insignia y hacer todos los cambios necesarios.\n\n* ¿Por qué bloqueamos insignias? *\n\nPara asegurarnos de que todos los usuarios tengan los mismos requisitos para ganar una insignia. En este momento, no es posible revocar insignias. Si permitimos que los requisitos de las insignias se puedan modificar en cualquier momento, lo más probable es que al final usuarios que tienen la misma insignia hayan tenido que satisfacer requisitos completamente diferentes.', null, '1472076156', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3613', 'es', '8', 'subject', 'Message subject', 'Asunto del mensaje', null, '1472076157', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3614', 'es', '8', 'variablesubstitution', 'Variable substitution in messages.', 'Sustitución de variables en los mensajes.', null, '1472076157', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('3615', 'es', '8', 'variablesubstitution_help', 'In a badge message, certain variables can be inserted into the subject and/or body of a message so that they will be replaced with real values when the message is sent. The variables should be inserted into the text exactly as they are shown below. The following variables can be used:\n\n%badgename%\n: This will be replaced by the badge\'s full name.\n\n%username%\n: This will be replaced by the recipient\'s full name.\n\n%badgelink%\n: This will be replaced by the public URL with information about the issued badge.', 'En un mensaje de insignia, ciertas variables se pueden insertar en el asunto y/o en el cuerpo del mensaje para que puedan ser sustituidas por valores reales cuando se envía el mensaje. Las variables deben insertarse en el el texto tal y como se muestra a continuación. Se pueden utilizar las siguientes variables:\n\n%badgename%\n: será reemplazado por el nombre completo de la insignia.\n\n%username%\n: será reemplazado por el nombre completo del destinatario.\n\n%badgelink%\n: será reemplazado por el URL pública con información sobre la insignia emitida.', null, '1472076157', null, '0', '0');
