INSERT INTO `mdl_tool_customlang` VALUES ('4125', 'es', '13', 'pref_lookahead_help', 'This sets the (maximum) number of days in the future that an event has to start in in order to be displayed as an upcoming event. Events that start beyond this will never be displayed as upcoming. Please note that <strong>there is no guarantee</strong> that all events starting in this time frame will be displayed; if there are too many (more than the \"Maximum upcoming events\" preference) then the most distant events will not be shown.', 'Esta opción ajusta el número (máximo) de días en que un evento debe comenzar a fin de poder mostrarse como evento pendiente. Por favor, note que <strong>no hay garantía</strong> de que se muestren todos los eventos que comiencen en esa fecha; si hay demasiados (más que los señalados en la preferencia \"Número máximo de eventos pendientes\"), los eventos más distantes no se mostrarán.', null, '1472076198', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4126', 'es', '13', 'pref_maxevents', 'Maximum upcoming events', 'Nº máximo de eventos próximos', null, '1472076198', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4127', 'es', '13', 'pref_maxevents_help', 'This sets the maximum number of upcoming events that can be displayed. If you pick a large number here it is possible that upcoming events displays will take up a lot of space on your screen.', 'Esta opción fija el número máximo de eventos pendientes que pueden mostrarse. Si escribe un número elevado, es posible que mostrar los eventos ocupe mucho espacio en la pantalla.', null, '1472076198', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4128', 'es', '13', 'pref_persistflt', 'Remember filter settings', 'Recordar ajustes de filtro', null, '1472076198', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4129', 'es', '13', 'pref_persistflt_help', 'If this is enabled, then Moodle will remember your last event filter settings and automatically restore them each time you login.', 'Si se activa, Moodle recordará los últimos ajustes del filtro de eventos y los restaurará de forma automática cada vez que entre al sitio.', null, '1472076198', null, '0', '0');
