INSERT INTO `mdl_tool_customlang` VALUES ('4249', 'es', '14', 'uploadcohorts_help', 'Cohorts may be uploaded via text file. The format of the file should be as follows:\n\n* Each line of the file contains one record\n* Each record is a series of data separated by commas (or other delimiters)\n* The first record contains a list of fieldnames defining the format of the rest of the file\n* Required fieldname is name\n* Optional fieldnames are idnumber, description, descriptionformat, visible, context, category, category_id, category_idnumber, category_path\n', 'Las cohortes se pueden cargas a través de archivos de texto. El formato del archivo deber ser el siguiente:\n* Cada línea de archivo contiene un registro\n* Cada registro es una serie de datos separados por comas (u otros delimitadores)\n* El primer registro contiene una lista de nombres de campo que define el formato del resto del archivo\n* El nomre es un campo obligatorio\n* Los campos opcionales son: idnumber, description, descriptionformat, visible, context, category, category_id, category_idnumber, category_path', null, '1472076209', null, '0', '0');
