INSERT INTO `mdl_tool_customlang` VALUES ('4401', 'es', '17', 'completion_help', 'If enabled, activity completion is tracked, either manually or automatically, based on certain conditions. Multiple conditions may be set if desired. If so, the activity will only be considered complete when ALL conditions are met.\n\nA tick next to the activity name on the course page indicates when the activity is complete.', 'Si se activa esta opción, se rastrea el grado de finalización de cualquier actividad, bien manual, bien automáticamente, basándose en determinadas condiciones. Si se desea, se pueden fijar múltiples condiciones. Si se hace así, la actividad únicamente se considerará completa si se cumplen TODAS las condiciones.\n\nUna marca al lado del nombre de la actividad enla página del curso indica cuándo la actividad está completa.', null, '1472076222', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4402', 'es', '17', 'completion_link', 'activity/completion', 'activity/completion', null, '1472076222', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4403', 'es', '17', 'completion_manual', 'Students can manually mark the activity as completed', 'Los estudiantes pueden marcar manualmente la actividad como completada', null, '1472076223', null, '0', '0');
