INSERT INTO `mdl_tool_customlang` VALUES ('4423', 'es', '17', 'completionusegrade_help', 'If enabled, the activity is considered complete when a student receives a grade. Pass and fail icons may be displayed if a pass grade for the activity has been set.', 'Si se activa, la actividad se considera finalizada cuando un estudiante recibe una calificación. Los iconos Aprobar y Suspender se muestran si se ha establecido una calificación de aprobado para la actividad.', null, '1472076224', null, '0', '0');
