INSERT INTO `mdl_tool_customlang` VALUES ('4456', 'es', '17', 'err_noactivities', 'Completion information is not enabled for any activity, so none can be displayed. You can enable completion information by editing the settings for an activity.', 'No está habilitada la información sobre la finalización de ninguna actividad. Puede activar la información sobre la finalización de una actividad editando su  parámetros de configuración.', null, '1472076227', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4457', 'es', '17', 'err_nocourses', 'Course completion is not enabled for any other courses, so none can be displayed. You can enable course completion in the course settings.', 'La finalización del curso no está habilitada para ningú otro curso, por lo que no se puede mostrar ninguno. Puede activar la finalización de cursos mediante los parámetros de configuración del curso.', null, '1472076227', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4458', 'es', '17', 'err_nograde', 'A course pass grade has not been set for this course. To enable this criteria type you must create a pass grade for this course.', 'En este curso no se ha establecido una calificación para pasar el curso. Para activar este tipo de criterio, debe crear una calificación para pasar el curso.', null, '1472076227', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4459', 'es', '17', 'err_noroles', 'There are no roles with the capability moodle/course:markcomplete in this course.', 'No hay roles con los permisos \'moodle/course:markcomplete\' en este curso.', null, '1472076227', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4460', 'es', '17', 'err_nousers', 'There are no students on this course or group for whom completion information is displayed. (By default, completion information is displayed only for students, so if there are no students, you will see this error. Administrators can alter this option via the admin screens.)', 'No hay estudiantes ni grupos en este curso para los que se muestre la información sobre finalización. (Por defecto, la información sobre finalización se muestra solo para estudiantes, por lo que si no hay estudiantes verá este error. Los administradores pueden modificar esta opción mediante las pantallas de administración)', null, '1472076227', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4461', 'es', '17', 'err_settingslocked', 'One or more students have already completed a criterion so the settings have been locked. Unlocking the completion criteria settings will delete any existing user data and may cause confusion.', 'Uno o más estudiantes han finalizado ya  un criterio, por lo que los parámetros han sido bloqueados. Desbloquer los parámetros de los criterios de finalización borrará cualquier dato de usuario lo que podría causar confusión.', null, '1472076227', null, '0', '0');
INSERT INTO `mdl_tool_customlang` VALUES ('4462', 'es', '17', 'err_system', 'An internal error occurred in the completion system. (System administrators can enable debugging information to see more detail.)', 'Se ha producido un error interno en el sistema de finalización. (Los administradores del sistema pueden habilitar la información de seguimiento para ver más detalles)', null, '1472076227', null, '0', '0');
